INSERT INTO `pages` (`id`, `navigation_location_id`, `title`, `body`, `banner_image`, `created_at`, `updated_at`, `body_bn`) VALUES
(2, 1, 'About Us', '<p><strong>Ekhoni Dorkar</strong> is an online e-commerce portal in Dhaka, Bangladesh.&nbsp; Our objective, to deliver fresh, organic, brand products, quality services for the people of Dhaka City. They do not need to spend more time to buy basic products for their daily requirements. <strong>Ekhoni Dorkar</strong> shall deliver the highest quality, fresh, brand products with the best possible price to your door-step within the shortest possible time.</p>', 'assets/images/pages/1599400091W-Cover--1.jpg', '2020-08-31 20:54:06', '2021-03-08 07:10:36', '<p><strong>এখনই দরকার</strong> বাংলাদেশের রাজধানী ঢাকার একটি অনলাইন ই-কমার্স পোর্টাল। আমাদের মূল উদ্দেশ্য হল শহরের ক্রেতাদের চাহিদা অনু্যায়ী টাটকা ও অর্গানিক সামগ্রী, ব্র্যান্ড পণ্য সরবরাহের মাধ্যমে মানসম্পন্ন সেবা প্রদান করা। এখন নিত্য প্রয়োজনীয় পণ্যসামগ্রী কিনতে ক্রেতাদের আর বেশি সময় ব্যয় করার প্রয়োজন হবে না। <strong>এখনই দরকার</strong> আপনার প্রয়োজনীয় সামগ্রী আপনার দোরগোড়ায় পৌঁছে দেবে সর্বনিম্নতম সময়ের মধ্যে। সর্বাধিক মানসম্পন্ন পণ্য, সেরা সম্ভাব্য মূল্য ও উন্নতমানের সেবা প্রদানের মাধ্যমে আমরা থাকবো ক্রেতাদের সাথে।</p>'),
(3, 1, 'FAQ', '<p><strong>Q.What is Ekhoni Dorkar?</strong></p>\r\n\r\n<p><strong>A.</strong> bangoshop.com is an online e-commerce shop in Dhaka, Bangladesh.&nbsp; Our objective, to deliver fresh, organic, brand products, quality services for the people of Dhaka City. They do not need to spend more time to buy basic products for their daily requirements. Ekhoni Dorkar shall deliver the highest quality, fresh, brand products with the best possible price to your door-step within the shortest possible time.</p>\r\n\r\n<p><strong>Q. How do I register on Ekhoni Dorkar?</strong></p>\r\n\r\n<p><strong>A. </strong>Simply click on Login/Signup and follow the prompts to set up a secure account.</p>\r\n\r\n<p><strong>Q. How do I place an order on Ekoni Dorkar?</strong></p>\r\n\r\n<p><strong>A. </strong>Shopping online is very easy. You just have to follow these simple steps:</p>\r\n\r\n<p><strong>Step 1</strong></p>\r\n\r\n<p>You can browse the site or use our search engine to find your desire products..</p>\r\n\r\n<p><strong>Step 2</strong></p>\r\n\r\n<p>If you decide to purchase an item, add the item to your Shopping Cart by clicking the &#39;Add to Cart&#39; button.</p>\r\n\r\n<p><strong>Step 3</strong></p>\r\n\r\n<p>You can view the contents of your Shopping Cart at any time by clicking the cart icon middle-right of each page. You can proceed to &lsquo;Checkout&rsquo; if you have added all your products.</p>\r\n\r\n<p><strong>Step 4</strong></p>\r\n\r\n<p>When you are ready to purchase your items, click the &#39;Add to Bag&#39; button. This will take you to the &#39;Shopping Cart&#39; which lists all of the items you have chosen to purchase, as well as the subtotal of the cost. If any special offers are available on your chosen items, the details of these will be displayed in your &#39;Shopping Cart&#39;.</p>\r\n\r\n<p><strong>Step 5</strong></p>\r\n\r\n<p>Enter your delivery address, choose your delivery time frame, provide your contact number, select your method of payment and click on &lsquo;Checkout&rsquo;.</p>\r\n\r\n<p><strong>Step 6</strong></p>\r\n\r\n<p>We will send you a confirmation SMS to confirm that we have received your order or we will call for confirmation in case cash on delivery.</p>\r\n\r\n<p><strong>Q. How much do deliveries cost?</strong>&nbsp;</p>\r\n\r\n<p><strong>A. </strong>Our delivery fee is BDT 40/- if the order value is BDT 1000/- or more. If the order value is less than BDT 1000/-, we charge BDT 50/- as delivery fee.&nbsp;</p>\r\n\r\n<p><strong>Q. How can I contact you?&nbsp;</strong></p>\r\n\r\n<p><strong>A.</strong> You can always call +880-140-4458-668&nbsp; or mail us at support@bangoshop.com.&nbsp;</p>\r\n\r\n<p><strong>Q. How long do the deliveries take?&nbsp;</strong></p>\r\n\r\n<p><strong>A.</strong> Our aim to deliver your products within 2 to 3 hours (conditions applied) in areas like Uttara, Uttar Khan, Dakshinkhan, Khilkhet, Nikunju. Areas like Banani, Gulshan, Boshundhara, Mirpur, Baridhara we will deliver within 3 to 5 hours time frame (conditions applied). For the rest of Dhaka city, we will deliver within 5 to 10 hours (conditions applied) time frame. You can also specify a convenient time and we will send the products during that time.&nbsp; In case&nbsp;of <strong>fresh fish&nbsp;</strong>and<strong>&nbsp;meat,&nbsp;</strong>we will&nbsp;deliver your products the next day.</p>\r\n\r\n<p><strong>Q. What are your delivery hours?&nbsp;</strong></p>\r\n\r\n<p><strong>A.&nbsp;</strong> It is from 9 am to 8 pm every day. You can also choose your own convenient delivery slot.&nbsp;</p>\r\n\r\n<p><strong>Q. What does your delivery means?</strong></p>\r\n\r\n<p><strong>A. </strong>We buy your products and do our delivery using our own delivery bikes, riders, and delivery personnel.</p>\r\n\r\n<p><strong>Q. What if I am not home to receive the delivery of my online order?</strong></p>\r\n\r\n<p><strong>A.</strong> You will get a call from the delivery personnel before making the delivery. During that call you can choose a preferred time frame for the delivery. You can also nominate another person who already knows all the details of your order. In this case please mention the contact details of the person who will receive your order. Delivery personnel will call your designated person to receive your ordered delivery. We may verify the representative with proof of your mentioned identity details.</p>\r\n\r\n<p><strong>Q. How will I know if the delivery is made to the right place?</strong></p>\r\n\r\n<p><strong>A. </strong>We will confirm the order through a phone call. We will also call you before making the delivery.</p>\r\n\r\n<p><strong>Q. How do I pay?&nbsp;</strong></p>\r\n\r\n<p><strong>A.</strong> We accept cash on delivery. We have a payment gateway for all sorts of Credit Card, Debit Card, bKash, Nogod services.&nbsp;</p>\r\n\r\n<p><strong>Q. Do you serve my area?&nbsp;</strong></p>\r\n\r\n<p><strong>A. </strong>We are currently serving Uttara, Uttar Khan, Dakshinkhan, Khilkhet, Nikunja within 2 to 3 hours. We deliver Gulshan, Banani, Baridhara, Mohakhali, DOHS, Bosudhara in 3 to 5 hours. Rest of the city the next day.</p>\r\n\r\n<p><strong>Q. My order is wrong. What do I do?&nbsp;</strong></p>\r\n\r\n<p><strong>A. </strong>Please Immediately call +880-140-4458-668 and let us know the problem.</p>\r\n\r\n<p><strong>Q. If I pay with my bank card and I don&rsquo;t like the product will you return the money?</strong></p>\r\n\r\n<p><strong>A.</strong> No, as the products are already purchased and bills are already made, we cannot return the money; instead we will replace the product; only if there is any reasonable ground.</p>\r\n\r\n<p>If you pay with your bank card and you want to cancel the order before/at the time of delivery only for that you don&rsquo;t like the product, we cannot return your money. Changes of intention are not acceptable.&nbsp;</p>\r\n\r\n<p>But, if we are unable to dispatch your order, we do not charge you and the money is automatically put back onto your available balance by your Bank. This usually takes around 07 (Seven) working days but the exact timeframe does depend on your card issuer and your bank.</p>\r\n\r\n<p>If this timeframe has elapsed, and the money still has not been released, please contact your card issuing bank or the Customer Service on +880-140-4458-668. (between 9 am - 8 pm every day). Ekhoni Dorkar authority will not be liable for any delay of card refunding issues if we&rsquo;ve done our functions with your bank within the above-mentioned time.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Q. What about the prices?&nbsp;</strong></p>\r\n\r\n<p><strong>A. </strong>We offer the best prices for you which is below the market prices or some cases at par. If you feel that any product is priced unfairly, please let us know.&nbsp;</p>\r\n\r\n<p><strong>Q. What about quality?&nbsp;</strong></p>\r\n\r\n<p><strong>A. </strong>Our experts source the best quality items for you but if you are dissatisfied, you can always send them back for replacement with the delivery person.</p>\r\n\r\n<p><strong>Q. What is your policy on refunds?&nbsp;</strong></p>\r\n\r\n<p><strong>A.</strong> You may get a refund within ten (10) days on un-opened or spoilt packaged products. For perishable products, such as milk, fruits and fresh vegetables, we have a one (1) day return policy. Please contact us at +880-140-4458-668 if you want to return an item.&nbsp;</p>\r\n\r\n<p><strong>Q. How are you sourcing your products?&nbsp;</strong></p>\r\n\r\n<p>A. We have deals with whole-sellers, manufacturers, and importers. We only sell authentic products.&nbsp;</p>\r\n\r\n<p><strong>Q. Can I order from abroad/outside Bangladesh?</strong></p>\r\n\r\n<p><strong>A.</strong> Yes, you can order from anywhere in the world and we will deliver your required products within our jurisdiction within the specified time frame. In this case please mention the contact details of the person who will receive your order.</p>\r\n\r\n<p>Kindly check the FAQs (Frequently Asked Questions) to get familiar with the functions of our platform. If you are not satisfied with the answers, then please call us on +880-140-4458-668 or write to us at support@bangoshop.com between 9 am - 8 pm every day to get our immediate help.</p>', 'assets/images/pages/1599400463W-Cover--3.jpg', '2020-09-06 17:54:23', '2021-05-18 08:08:57', '<p><strong>প্র: এখনই দরকারে কীভাবে নিবন্ধন/রেজিষ্ট্রেশন&nbsp; করব?</strong></p>\r\n\r\n<p><strong>উ: </strong>লগইন / সাইনআপে ক্লিক করুন এবং একটি সুরক্ষিত অ্যাকাউন্ট সেট আপ করার ধাপগুলি অনুসরণ করুন।</p>\r\n\r\n<p><strong>প্র: আমি কীভাবে এখনই দরকারে অর্ডার করবো?</strong></p>\r\n\r\n<p><strong>উ:</strong> অনলাইনে কেনাকাটা করা খুব সহজ।&nbsp; আপনাকে কেবল এই সাধারণ পদক্ষেপগুলি অনুসরণ করতে হবে:</p>\r\n\r\n<p><strong>ধাপ 1</strong></p>\r\n\r\n<p>আপনার পছন্দসই পণ্যগুলি খুঁজতে আপনি পোর্টালটি ব্রাউজ করতে পারেন বা আমাদের অনুসন্ধান ইঞ্জিন ব্যবহার করতে পারেন ..</p>\r\n\r\n<p><strong>ধাপ ২</strong></p>\r\n\r\n<p>আপনি যদি কোনও পণ্য ক্রয়ের সিদ্ধান্ত নেন, &#39;কার্টে যুক্ত করুন&#39; বোতামটি ক্লিক করে আপনার শপিং কার্টে পণ্যটি&nbsp; যুক্ত করুন।&nbsp;&nbsp;</p>\r\n\r\n<p><strong>ধাপ ৩</strong></p>\r\n\r\n<p>আপনি প্রতিটি পৃষ্ঠার মাঝের ডানদিকে কার্ট আইকনটি ক্লিক করে আপনার শপিং কার্টের সামগ্রীগুলি যে কোনও সময় দেখতে পারেন।&nbsp; আপনি যদি আপনার সমস্ত পণ্য যুক্ত করে থাকেন তবে আপনি &lsquo;চেকআউট&rsquo; এ যেতে পারেন।</p>\r\n\r\n<p><strong>ধাপ ৪</strong></p>\r\n\r\n<p>আপনি আপনার পণ্যগুলি কেনার সিদ্ধান্ত সিদ্ধান্ত নিলে, &quot;ব্যাগে যুক্ত করুন&quot; বোতামটি ক্লিক করুন। এটি আপনাকে &quot;শপিং কার্টে&quot; নিয়ে যাবে যা আপনাকে আপনার ক্রয়ের জন্য বেছে নেয়া সমস্ত পণ্যের সর্বমোট ব্যয়ের তালিকাসহ উপস্থাপন করবে। যদি আপনার নির্বাচিত পণ্যগুলিতে কোন বিশেষ অফার পাওয়া যায়, তবে অফারের বিবরণ&nbsp; আপনার &quot;শপিং কার্টে&quot; প্রদর্শিত হবে।</p>\r\n\r\n<p><strong>ধাপ ৫</strong></p>\r\n\r\n<p>আপনার ঠিকানা প্রবেশ করুন, পণ্য সরবরাহের সময় নির্বাচন করুন, আপনার যোগাযোগ নম্বর প্রদান করুন, পণ্যের মূল্য পরিশোধের পদ্ধতি নির্বাচন করুন , এবং &quot;চেক-আউট&quot; এ ক্লিক করুন।</p>\r\n\r\n<p><strong>ধাপ ৬</strong></p>\r\n\r\n<p>আপনার অর্ডারটি নিশ্চিত করার জন্য আমরা আপনাকে একটি এসএমএস পাঠাবো অথবা &quot;ক্যাশ অন ডেলিভারি&quot; নিশ্চিত করার জন্য আপনাকে কল করব।</p>\r\n\r\n<p><strong>প্র: ডেলিভারি চার্জ কত?</strong></p>\r\n\r\n<p>উঃ আপনার ওয়ার্ড টি যদি ৫০০/= টাকার বা আরো বেশী হয় তাহলে ডেলিভারি চার্জ ৫০/= । যদি মান ৫০০/=&nbsp; এর কম হয় তবে ডেলিভারি চার্জ ৬০/=&nbsp; টাকা ।</p>\r\n\r\n<p><strong>প্র: আমি কিভাবে আপনার সাথে যোগাযোগ করতে পারি?</strong></p>\r\n\r\n<p>উ: আমাদের সাথে যোগাযোগ করার জন্য আপনি&nbsp; +৮৮০-১৪০-৪৪৫৮-৬৬৮ নম্বরে কল করতে পারেন বা support@bangoshop.com এ আমাদের মেইল ​​করতে পারেন।</p>\r\n\r\n<p><strong>প্র:&nbsp; পণ্য সরবরাহ করতে কতটা সময় লাগবে?</strong></p>\r\n\r\n<p>উ: আমাদের লক্ষ্য উত্তরা, উত্তর খান, দক্ষিণখান, খিলক্ষেত, নিকুঞ্জর মতো অঞ্চলে আপনার পণ্যগুলি ২ থেকে ৩ ঘন্টার মধ্যে (শর্ত প্রযোজ্য) সরবরাহ করা।&nbsp; ঢাকা শহরের অন্যান্য এলাকায় (বনানী, গুলশান, বসুন্ধরা, মিরপুর,বারিধারা)&nbsp; আমরা ৩ থেকে ৫ ঘন্টা সময়সীমার মধ্যে (শর্ত প্রযোজ্য) সরবরাহ করব। বাকী এলাকাগুলিতে ৫ থেকে ১০ ঘন্টা সময়ের মধ্যে পণ্য সরবরাহ করা হবে। আপনি আপনার সুবিধাজনক সময় নির্দিষ্ট করে অর্ডার করতে পারেন এবং আমরা সেই সময়ে পণ্যগুলি প্রেরণ করব। শুধু মাত্র তাজা&nbsp;মাছ এবং মাংস ক্ষেত্রে আমরা আপনার পণ্য পরের দিন সরবরাহ করবো।</p>\r\n\r\n<p><strong>প্র: পণ্য সরবরাহ করার সময় কতক্ষণ ?</strong></p>\r\n\r\n<p>উ: প্রতিদিন সকাল ৭টা থেকে রাত ৭টা পর্যন্ত।&nbsp; আপনি নিজের সুবিধাজনক বিতরণ সময়সূচী নির্বাচন করতে পারেন।</p>\r\n\r\n<p><strong>&nbsp;প্র: পণ্য সরবরাহ বলতে কি বোঝায়?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>উ: আপনার অর্ডারকৃত পণ্যগুলি&nbsp; আমাদের নিজস্ব সরবরাহ কর্মী দ্বারা নিজস্ব পরিবহন ব্যবহার করে আপনাদের পৌঁছে দেই।</p>\r\n\r\n<p><strong>প্র: আমি যদি আমার অনলাইন অর্ডারকৃত পণ্য গ্রহনের&nbsp; জন্য বাড়িতে না থাকি তাহলে কী হবে?</strong></p>\r\n\r\n<p>উ: পণ্য সরবরাহের আগে পণ্য সরবরাহকারীর কর্মীদের কাছ থেকে কল পাবেন।&nbsp; এই কল চলাকালীন সময়ে আপনি পণ্য গ্রহনের জন্য একটি পছন্দসই সময়সীমা বেছে নিতে পারেন।&nbsp; আপনি অন্য কোনও ব্যক্তিকেও মনোনীত করতে পারেন যিনি ইতিমধ্যে আপনার অর্ডারের সমস্ত বিবরণ জানেন।&nbsp; এই ক্ষেত্রে আপনার অর্ডারকৃত পণ্য গ্রহনকারী ব্যক্তির যোগাযোগের বিস্তারিত বর্ণনা উল্লেখ করুন।&nbsp; সরবরাহকারী কর্মীরা আপনার অর্ডার করা পণ্য সরবরাহ করার জন্য&nbsp; আপনার মনোনীত ব্যক্তিকে কল করে উল্লিখিত পরিচয় বিবরণের প্রমাণ সহ প্রতিনিধিকে যাচাই করবে।</p>\r\n\r\n<p><strong>প্র: অর্ডারকৃত পণ্য সঠিক জায়গায় পৌঁছে দেওয়া হয়েছে কিনা তা কীভাবে আমি জানব?</strong></p>\r\n\r\n<p>উ: আমরা একটি ফোন কলের মাধ্যমে অর্ডারটি নিশ্চিত করব।&nbsp; পণ্য সরবরাহের আগেও আপনাকে আমরা কল করব।</p>\r\n\r\n<p><strong>প্র: আমি কীভাবে অর্থ প্রদান করব?</strong></p>\r\n\r\n<p>উ: আমরা পণ্যের মূল্য ক্যাশ-অন-ডেলিভারি সার্ভিস গ্রহণ করি।&nbsp; আমাদের কাছে সব ধরণের ক্রেডিট কার্ড, ডেবিট কার্ড, বিকাশ, নগদ পরিসেবাগুলির জন্য পেমেন্ট গেটওয়ে রয়েছে।</p>\r\n\r\n<p><strong>প্র:&nbsp; আমার এলাকায় কি পণ্য সরবরাহ করা হয়?</strong></p>\r\n\r\n<p>উঃ আমরা উত্তরা, উত্তর খান, দক্ষিণখান, খিলক্ষেত, নিকুঞ্জর মতো অঞ্চলে আপনার পণ্যগুলি ২ থেকে ৩ ঘন্টার মধ্যে (শর্ত প্রযোজ্য)সরবরাহ করা।&nbsp; ঢাকা শহরের অন্যান্য এলাকায়( বনানী, গুলশান, বসুন্ধরা, মিরপুর,বারিধারা)&nbsp; আমরা ৩ থেকে ৫ ঘন্টা সময়সীমার মধ্যে (শর্ত প্রযোজ্য) সরবরাহ করব। বাকী এলাকাগুলিতে ৫ থেকে ১০ ঘন্টা সময়ের মধ্যে পণ্য সরবরাহ করা হবে। আপনি আপনার সুবিধাজনক সময় নির্দিষ্ট করে অর্ডার করতে পারেন এবং আমরা সেই সময়ে পণ্যগুলি প্রেরণ করব।</p>\r\n\r\n<p><strong>প্র: আমার অর্ডারটি ভুল।&nbsp; আমি কি করব?</strong></p>\r\n\r\n<p>উ: দয়া করে অবিলম্বে&nbsp; +৮৮০-১৪০-৪৪৫৮-৬৬৮ কল করুন এবং আমাদেরকে সমস্যাটি জানান।</p>\r\n\r\n<p><strong>প্র: আমি যদি আমার কার্ড দিয়ে অর্থ প্রদান করি এবং আমি পণ্যটি পছন্দ না করি আপনি কি টাকা ফেরত দেবেন?</strong></p>\r\n\r\n<p><strong>উ: </strong>না, পণ্যগুলি ইতিমধ্যে কেনা হয়েছে এবং বিলগুলি ইতিমধ্যে তৈরি হয়েছে, আমরা এই টাকা ফেরত দিতে পারি না;&nbsp; পরিবর্তে আমরা পণ্য প্রতিস্থাপন করব;&nbsp; যদি কোনও যুক্তিসঙ্গত ভিত্তি থাকে তবেই।&nbsp;আপনি যদি আপনার কার্ড দিয়ে অর্থ প্রদান করেন এবং পণ্যটি আপনার পছন্দ হয়নি তার জন্য সরবরাহের আগে/ সময় অর্ডারটি বাতিল করতে চান,সেক্ষেত্রে আপনার অর্থ ফেরত দেয়া হবে না। পণ্য পরিবর্তনের মনোভাব গ্রহণযোগ্য নয়।</p>\r\n\r\n<p>তবে, আমরা যদি আপনার অর্ডার প্রেরণে অক্ষম হয়ে থাকি তবে আমরা আপনার কার্ডের অর্থ&nbsp; গ্রহন করব না এবং অর্থটি স্বয়ংক্রিয়ভাবে ব্যাংকের মাধ্যমে আপনার একাউন্টে&nbsp; ফিরিয়ে দেওয়া হবে।&nbsp; এটি সাধারণত ০৭ (সাত) কার্যদিবসের সময় নেয় তবে সঠিক সময়সীমা আপনার কার্ড ইস্যুকারী এবং আপনার ব্যাংকের উপর নির্ভর করে।</p>\r\n\r\n<p>যদি এই সময়সীমাটি অতিবাহিত হয়ে থাকে এবং এখনও অর্থটি আপনার একাউন্টে ফেরত না যায় তবে দয়া করে আপনার কার্ড প্রদানকারী ব্যাংক বা গ্রাহক পরিসেবার সাথে +880-140-4458-668 এ যোগাযোগ করুন।&nbsp; (প্রতিদিন সকাল ৭টা থেকে ৬টা অবধি)।&nbsp; উপরে বর্ণিত সময়ের মধ্যে আমরা যদি আপনার ব্যাংকের সাথে আমাদের কাজগুলি সম্পন্ন করি তবে কার্ড ফেরত দেওয়ার বিষয়ে বিলম্বের জন্য &quot;এখনই দরকার&quot; কর্তৃপক্ষ দায়বদ্ধ হবে না।</p>\r\n\r\n<p><strong>&nbsp;প্র: পণ্যের মূল্য কীভাবে নির্ধারণ করা হবে?</strong></p>\r\n\r\n<p><strong>&nbsp;উ: </strong>আমরা আপনার জন্য সেরা মূল্য অফার করি যা বাজারের দামের তুলনায় কম বা কিছু ক্ষেত্রে সমপর্যায়ের।&nbsp; আপনি যদি মনে করেন যে কোনও পণ্যের মূল্য অন্যায়ভাবে দেওয়া হয়, দয়া করে আমাদের জানান।</p>\r\n\r\n<p><strong>&nbsp;প্র: পণ্যের গুণগত মান কেমন ?</strong></p>\r\n\r\n<p><strong>&nbsp;উ: </strong>আমাদের বিশেষজ্ঞরা আপনার জন্য সর্বোত্তম মানের পণ্য নির্বাচন করে। তবে আপনি যদি অসন্তুষ্ট হন তবে আপনি&nbsp; সরবরাহকারী ব্যক্তির সাথে পণ্যগুলি প্রতিস্থাপনের জন্য ফেরত পাঠাতে পারেন।</p>\r\n\r\n<p><strong>&nbsp;প্র: ফেরতের বিষয়ে আপনার নীতি কী?</strong></p>\r\n\r\n<p><strong>&nbsp;উ: </strong>আপনি খোলা বা ক্ষতিগ্রস্থ প্যাকেজজাত পণ্যগুলি দশ (১০) কার্যদিবসের মধ্যে ফেরত পেতে পারেন।&nbsp; দুগ্ধ, ফলমূল এবং তাজা শাকসব্জির মতো বিনষ্টযোগ্য পণ্যগুলির জন্য আমাদের এক (১) দিনের রিটার্ন পলিসি রয়েছে।&nbsp; আপনি যদি কোনও পণ্য ফেরত দিতে চান তবে দয়া করে আমাদের সাথে +৮৮০-১৪০-৪৪৫৮-৬৬৮ এ যোগাযোগ করুন।</p>\r\n\r\n<p><strong>&nbsp;প্র: আপনি কীভাবে আপনার পণ্যগুলিকে সোর্সিং করছেন?</strong></p>\r\n\r\n<p><strong>&nbsp;উ: </strong>আমাদের পণ্য বিক্রয়কারী, প্রস্তুতকারক এবং আমদানিকারকদের সাথে চুক্তি রয়েছে।&nbsp; আমরা কেবল খাঁটি পণ্য বিক্রি করি।</p>\r\n\r\n<p><strong>&nbsp;প্র: আমি বিদেশ থেকে / বাংলাদেশের বাইরে থেকে অর্ডার করতে পারি?</strong></p>\r\n\r\n<p>&nbsp;উ: হ্যাঁ, আপনি বিশ্বের যে কোনও জায়গা থেকে অর্ডার করতে পারেন এবং আমরা আপনার প্রয়োজনীয় পণ্যগুলিকে নির্দিষ্ট সময়সীমার মধ্যে আমাদের সাধ্যের মধ্যে সরবরাহ করব।&nbsp; এই ক্ষেত্রে দয়া করে আপনার অর্ডারটি প্রাপ্ত ব্যক্তির যোগাযোগের বর্ণনা উল্লেখ করুন।</p>\r\n\r\n<p>আমাদের প্ল্যাটফর্মের ক্রিয়াকলাপগুলির সাথে পরিচিত হওয়ার জন্য দয়া করে সাধারণত জিজ্ঞাসিত প্রশ্নাবলী (প্রায়শই জিজ্ঞাসিত প্রশ্নাবলী) পরীক্ষা করুন। আপনি যদি উত্তরগুলির সাথে সন্তুষ্ট না হন তবে আমাদের তাৎক্ষণিক সহায়তা পেতে প্রতিদিন সকাল ৭টা থেকে ৬ টার মধ্যে আমাদের +৮৮০-১৪০-৪৪৫৮-৬৬৮ নম্বরে কল করুন বা আমাদের কাছে support@bangoshop.com মেইল করুন।</p>'),
(4, 1, 'Privacy Policy', '<p>When you use our Website, we collect and store your personal information which is provided by you from time to time. Our primary goal in doing so is to provide you a safe, efficient, smooth and customized experience.&nbsp;</p>\r\n\r\n<p><strong>Personal Identification Information</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Information customers give us:</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>We may collect personal identification information from users in different ways, like, when users visit our site, register on the site, place an order, fill out a form, respond to a survey, subscribe to the newsletter and in connection with other activities, services, features or resources we have on our site.</p>\r\n\r\n<ul>\r\n	<li><strong>What kind of information:</strong></li>\r\n</ul>\r\n\r\n<p>Users may be asked for, name, email address, mailing address, phone number, debit/credit card information etc. when required. Whenever the users interact with our website we get information like their browser names, device type, the means of connection with our site, their internet connection details, their location, and other similar information.</p>\r\n\r\n<ul>\r\n	<li><strong>E-mail Communications:</strong></li>\r\n</ul>\r\n\r\n<p>We get the user&#39;s email addresses when they place an order through our website. We send our newsletter and different offers according to the customer profile to them. If the user does not want to receive e-mail or other mail from us, they can unsubscribe easily.</p>\r\n\r\n<ul>\r\n	<li><strong>Payment:</strong></li>\r\n</ul>\r\n\r\n<p>If you have already made a payment twice for your single purchase, then please contact your bank to reverse the payment or cancel the payment as in Ekhoni Dorkar we have no control or access to your payments. Your payment related information is also kept secret to us from the bank. During the payment process, if you get disconnected then please contact your bank to ensure if the payment went through or not, if not then please make the payment again.</p>\r\n\r\n<p><strong>How do we use this information?</strong></p>\r\n\r\n<p>&nbsp;Ekhoni Dorkar collects and uses Users personal information for the following purposes:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>a) To improve customer service:</strong></p>\r\n\r\n<p>Your information helps us to more effectively respond to your customer service requests and support needs.</p>\r\n\r\n<p>&nbsp; &nbsp; <strong>&nbsp;b)&nbsp;To improve our Site</strong>:</p>\r\n\r\n<p>We continually strive to improve our website offerings based on the information and feedback we receive from you.</p>\r\n\r\n<p>&nbsp; &nbsp;<strong> c) To process transactions:</strong></p>\r\n\r\n<p>We may use the information users provide only to respond to their product requests. We do not share this information with anyone else except to the extent necessary to provide the service.</p>\r\n\r\n<p>We adopt appropriate data collection, storage, and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.</p>\r\n\r\n<p><strong>Ekhoni Dorkar </strong>has the discretion to update this privacy policy at any time. When we do, revise the updated date at the bottom of this page, send you an email. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect.</p>\r\n\r\n<p>By using this Site, you signify your acceptance of this policy and terms of service. If you do not agree to this policy, please do not use our Site</p>', 'assets/images/pages/1599400852W-Cover--1.jpg', '2020-09-06 18:00:52', '2021-03-08 08:35:11', '<p>যখন আপনি আমাদের ওয়েবসাইটটি ব্যবহার করেন তখন আমরা আপনার ব্যক্তিগত তথ্য সংগ্রহ এবং সংরক্ষণ করি যা আপনার দ্বারা বিভিন্ন সময়ে সরবরাহ করা হয়। যার প্রাথমিক লক্ষ্য আপনাকে একটি নিরাপদ,দক্ষ, এবং বিশেষায়িত অভিজ্ঞতা প্রদান করা ।</p>\r\n\r\n<p><strong>ব্যক্তিগত সনাক্তকরণ তথ্য</strong></p>\r\n\r\n<p><strong>১. গ্রাহকরা আমাদের&nbsp; যে তথ্য&nbsp; প্রদান করে :</strong></p>\r\n\r\n<p>আমরা ব্যবহারকারীদের কাছ থেকে বিভিন্ন উপায়ে ব্যক্তিগত সনাক্তকরণ তথ্য সংগ্রহ করতে পারি, যেমন ব্যবহারকারীরা যখন আমাদের সাইটে যান, সাইটে নিবন্ধন করেন, অর্ডার দেন, একটি ফর্ম পূরণ করেন, একটি সমীক্ষায় প্রতিক্রিয়া জানান, নিউজলেটারে সাবস্ক্রাইব করে এবং অন্যান্য ক্রিয়াকলাপের সাথে সম্পর্কিত হন , সেবা , বৈশিষ্ট্য বা সংস্থান যা আমাদের সাইটে আছে।</p>\r\n\r\n<p><strong>২. কী ধরণের তথ্য:</strong></p>\r\n\r\n<p>প্রয়োজনে ব্যবহারকারীদের নাম, ইমেল ঠিকানা, মেলিং ঠিকানা, ফোন নম্বর, ডেবিট / ক্রেডিট কার্ড সম্পর্কিত তথ্য ইত্যাদি জিজ্ঞাসা করা যেতে পারে। ব্যবহারকারীরা যখনই আমাদের ওয়েবসাইটের সাথে যোগাযোগ করে আমরা তাদের ব্রাউজারের নাম, ডিভাইসের ধরণ, আমাদের সাইটের সাথে সংযোগের উপায়, তাদের ইন্টারনেট সংযোগের বিস্তারিত,&nbsp; তাদের অবস্থান এবং অন্যান্য অনুরূপ তথ্যের মতো তথ্য পাই।</p>\r\n\r\n<p><strong>৩. ই-মেইল যোগাযোগ:</strong></p>\r\n\r\n<p>তারা যখন আমাদের ওয়েবসাইটের মাধ্যমে অর্ডার দেয় তখন আমরা ব্যবহারকারীর ইমেল ঠিকানাগুলি পাই। আমরা তাদের আমাদের গ্রাহক প্রোফাইল অনুযায়ী আমাদের নিউজলেটার এবং বিভিন্ন অফার প্রেরণ করি। যদি ব্যবহারকারী আমাদের কাছ থেকে ইমেল বা অন্য মেল গ্রহণ করতে&nbsp; না চান তবে তারা সহজেই সদস্যতা রোধ করতে পারেন।</p>\r\n\r\n<p><strong>৪. অর্থ প্রদান:</strong></p>\r\n\r\n<p>আপনি যদি ইতিমধ্যে আপনার একক ক্রয়ের জন্য দু&#39;বার অর্থ প্রদান করেছেন, তবে দয়া করে ব্যাংকের সাথে&nbsp; যোগাযোগ করুন আপনার&nbsp; অর্থ প্রদানের বিপরীতে অথবা&nbsp; আপনার অর্থ প্রদান বাতিল করার জন্য এখনি দরকার থেকে । আপনার অর্থ প্রদানের তথ্যটি ব্যাংক থেকে আমাদের কাছে ও&nbsp; গোপন রাখা হয়েছে। অর্থ&nbsp; প্রদানের প্রক্রিয়া চলাকালীন, আপনার সংযোগটি যদি&nbsp; বিচ্ছিন্ন হয়ে পড়ে তবে দয়া করে আপনার ব্যাঙ্কের সাথে যোগাযোগ করুন পেমেন্টটি হয়েছে কিনা তা নিশ্চিত করার জন্য, যদি না হয় তবে দয়া করে আবার অর্থ প্রদান করুন।</p>\r\n\r\n<p><strong>কীভাবে আমরা এই তথ্য ব্যবহার করি?</strong></p>\r\n\r\n<p>এখনি দরকার&nbsp; নিম্নলিখিত উদ্দেশ্যে ব্যবহারকারীদের ব্যক্তিগত তথ্য সংগ্রহ এবং ব্যবহার করে:</p>\r\n\r\n<p><strong>ক) গ্রাহক&nbsp; সেবা উন্নত &nbsp; করতে:</strong></p>\r\n\r\n<p>আপনার তথ্য আমাদের সাহায্য করে আরও কার্যকরভাবে সাড়া&nbsp; দিতে&nbsp; আপনার গ্রাহক সেবা&nbsp; অনুরোধ এবং প্রয়োজনীয় সহায়তায়।</p>\r\n\r\n<p><strong>খ) আমাদের সাইটের উন্নতি করতে:</strong></p>\r\n\r\n<p>আমরা আপনার কাছ থেকে প্রাপ্ত তথ্য এবং প্রতিক্রিয়ার উপর ভিত্তি করে আমাদের ওয়েবসাইট অফারগুলি উন্নত করার জন্য ক্রমাগত চেষ্টা করি।</p>\r\n\r\n<p><strong>গ) লেনদেন প্রক্রিয়া করতে:</strong></p>\r\n\r\n<p>আমরা কেবল তাদের অনুরোধিত পণ্যের&nbsp; প্রতিক্রিয়া জানাতে ব্যবহারকারীদের সরবরাহিত তথ্য ব্যবহার করতে পারি। সেবা সরবরাহের জন্য প্রয়োজনীয় বিষয়বস্তু&nbsp; ব্যতীত আমরা অন্য কারও সাথে এই তথ্যটি ভাগ করি না।&nbsp;আমরা আমাদের সাইটে সংরক্ষণ করা আপনার ব্যক্তিগত তথ্য, ব্যবহারকারীর নাম, পাসওয়ার্ড, লেনদেনের তথ্য এবং অননুমোদিত তথ্য&nbsp; প্রবেশ, পরিবর্তন, প্রকাশ বা বিনাশের&nbsp; বিরুদ্ধে সুরক্ষার জন্য যথাযথ তথ্য সংগ্রহ, সঞ্চয় এবং প্রক্রিয়াকরণ অনুশীলন এবং সুরক্ষা ব্যবস্থা গ্রহণ করি।</p>\r\n\r\n<p><strong>এখনি দরকার&nbsp;</strong> যে কোনও সময় এই গোপনীয়তা নীতি আধুনিকায়ন&nbsp; করার অধিকার&nbsp; রাখে। আমরা যখন নীতি আধুনিকায়ন&nbsp; করি, আপনাকে একটি ইমেল প্রেরণ করার মাধ্যমে&nbsp; জানানো হবে, যা আপনি আমাদের পৃষ্ঠার নিচে নতুন&nbsp; সংশোধনী তারিখ&nbsp; টি পাবেন । আমরা যে ব্যক্তিগত তথ্য সংগ্রহ করি তা সুরক্ষিত করতে কীভাবে সহায়তা করছি সে সম্পর্কে অবহিত থাকার জন্য আমরা কোনও&nbsp; পরিবর্তনের জন্য ব্যবহারকারীদের প্রায়শই এই পৃষ্ঠাটি যাচাই করতে উৎসাহিত করি।</p>\r\n\r\n<p>এই সাইটটি ব্যবহার করে, আপনি এই নীতি এবং সেবা শর্তাদি আপনার স্বীকৃতি জানান। আপনি যদি এই নীতিতে সম্মত না হন তবে দয়া করে আমাদের সাইটটি ব্যবহার করবেন না।</p>'),
(5, 1, 'Terms and Conditions', '<p><strong>INTRODUCTION</strong></p>\r\n\r\n<p>bangoshop.com is an online e-commerce shop where you can browse, select and order products and services advertised.</p>\r\n\r\n<p>Welcome to bangoshop.com. Ekhoni Dorkar (&ldquo;Ekhoni Dorkar&rdquo;) provides access to the bangoshop.com website or the mobile application/app or any other media (&quot;Website&quot;) to you subject to the terms and conditions (&ldquo;Terms&rdquo;) set out on this page. By using the Website, you, a registered or guest user in terms of the eligibility criteria set out herein (&ldquo;User&rdquo;) agree to be bound by the Terms. Please read them carefully as your continued usage of the Website, you signify your agreement to be bound by these Terms. If you do not want to be bound by the Terms, you must not subscribe to or use the Website or our services.&nbsp;</p>\r\n\r\n<p>The Site reserves the right to change, modify, add, or remove portions of these Terms and Conditions at any time without any prior notification. Changes will be effective when posted on the Site with no other notice provided. Please check these Terms and Conditions regularly for updates. Your continued use of the Site following the posting of changes to Terms and Conditions of use constitutes your acceptance of those changes.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>In these Terms, references to &quot;you&quot;, &quot;User&quot; shall mean the end user/customer accessing the Website, its contents and using the Services offered through the Website. References to the &ldquo;Website&rdquo;, &quot;Ekhoni Dorkar&quot;, &ldquo;bangoshop.com&rdquo;, &quot;we&quot;, &quot;us&quot; and &quot;our&quot; shall mean the Website and/or Ekhoni Dorkar.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>The contents set out herein form an electronic record in terms of তথ্য ও যোগাযোগ প্রযুক্তি আইন, ২০০৬ (Information &amp; Communication Technology Act, 2006) and rules there under as applicable and as amended from time to time. As such, this document does not require any physical or digital signatures and forms a valid and binding agreement between the Website and the User.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>This Website may also contain links to other websites, which are not operated by Ekhoni Dorkar, and Ekhoni Dorkar has no control over the linked sites and accepts no responsibility for them or for any loss or damage that may arise from your use of them. Your use of the linked sites will be subject to the terms of use and service contained within each such site.&nbsp;</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Registration</strong></p>\r\n\r\n<p>You must complete the customer registration process through the site before placing an order for products through the site.</p>\r\n\r\n<p>You may not have more than one active account, and your account is non-transferable. You may update, edit or terminate your account at any time through the site. You may not have more than two accounts per delivery address.</p>\r\n\r\n<p>If you choose to use a workplace email address for your account or to access the site, then you are solely responsible for ensuring that you comply with the rules, policies or protocols that apply to the use of your email address and your workplace facilities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Placing an Order for Products</strong></p>\r\n\r\n<p>You may order products by selecting and submitting your order through the site.</p>\r\n\r\n<p>Any order placed through this site for a product is an offer by you to purchase the particular product for the price notified (including the delivery and other charges and taxes) at the time you place the order.</p>\r\n\r\n<p>We may ask you to provide additional details or require you to confirm your details to enable us to process any orders placed through the site.</p>\r\n\r\n<p>You agree to provide us with current, complete and accurate details when asked to do so by the site.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Cancellation Policy</strong></p>\r\n\r\n<p>We reserve the right to accept or reject your order for any reason, including if the requested product is not available if there is an error in the price or the product description posted on the site or an error in your order. We also reserve the right to cancel any order without giving any reason(s). We also have the right to suspend or remove a user account without giving any notice or justification to the user. We will keep every unverified order for 6 (six) hours and make several attempts to verify. If there is no response, after that time the order will be automatically canceled.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Delivery of Products</strong></p>\r\n\r\n<p>We will only deliver products ordered through the site to a location where we provide delivery services. You may obtain further information on the site about our delivery time frames and how we deliver your products.</p>\r\n\r\n<p>We will deliver the products to the front door at the relevant delivery address. If you ask us to deliver inside a premise or building at the delivery address, our delivery concern persons&rsquo; are strictly instructed not to go inside or any place except the front door.</p>\r\n\r\n<p>If you are not the person collecting your ordered items, then your representative must provide us with proof of their identity. You acknowledge that we may record the details of any identification provided in relation to the collection of products.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Return Policy</strong>&nbsp;</p>\r\n\r\n<p>A user may return any product during the time of delivery, or within 10 days if:&nbsp;</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>The product does not meet the user&#39;s expectations.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Found damaged during delivery.</p>\r\n	</li>\r\n	<li>\r\n	<p>Have doubts about product quality and quantity.</p>\r\n	</li>\r\n	<li>\r\n	<p>Received in an unhealthy/ unexpected condition.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>A user may return any unopened or spoiled packaged products, items within 10 days of receiving the item. But the following products may not be eligible for return or replacement:&nbsp;</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Damages due to misuse of a product&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Incidental damage due to malfunctioning of product&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Products with tampered or missing serial/UPC numbers&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Any damage/defect which is not covered under the manufacturer&#39;s warranty&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Any product that is returned without all original packaging and accessories, including the box, manufacturer&#39;s packaging if any, and all other items originally included with the product/s delivered.&nbsp;</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Refund Policy</strong></p>\r\n\r\n<p>If you have made an online pre-payment/card payment against your order, and there are product/s which is/are not available in stock, we will offer you product replacement options within the same price range. If for any reason, you decline to take product replacements, then the order will be canceled and we will start the refund process. Please make sure to make your refund request by calling our Customer Service on +880-140-4458-668. (between 9 am - 8 pm every day). Ekhoni Dorkar will retain full right over the refund payment medium, given that it reaches you deducting the bank or Bikash or other medium charges. The refund process will usually take approximately 10 to 15 banking days to complete from the refund request date. That means you will receive your refund within 15 banking days of conveying the refund request through our Customer Service helpline.</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Cookies&nbsp;</strong></p>\r\n\r\n<p>This site uses cookies, which means that you must have cookies enabled on your computer in order for all functionality on this site to work properly. A cookie is a small data file that is written to your hard drive when you visit certain Websites. Cookie files contain certain information, such as a random number user ID that the site assigns to a visitor to track the pages visited. A cookie cannot read data off your hard disk or read cookie files created by other sites. Cookies, by themselves, cannot be used to find out the identity of any user.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Copyright&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>The material (including the content, and any other content, software or services) contained on bangoshop.com are the property of Ekhoni Dorkar, its subsidiaries, affiliates and/or third party licensors. No material on this site may be copied, reproduced, republished, installed, posted, transmitted, stored or distributed without written permission from Ekhoni Dorkar.&nbsp;</li>\r\n	<li>You may not use any &ldquo;deep-link&rdquo;, &ldquo;page-scrape&rdquo;, &ldquo;robot&rdquo;, &ldquo;spider&rdquo; or other automatic devices, program, algorithm or methodology, or any similar or equivalent manual process, to access, acquire, copy or monitor any portion of the website or any content, or in any way reproduce or circumvent the navigational structure or presentation of the website or any content, to obtain or attempt to obtain any materials, documents or information through any means not purposely made available through the website. We reserve our right to bar any such activity.</li>\r\n</ol>', 'assets/images/pages/1599401554W-Cover--1.jpg', '2020-09-06 18:12:34', '2021-03-08 07:10:09', '<p><strong>ভূমিকা</strong></p>\r\n\r\n<p><strong>এ</strong>খনই দরকার একটি অনলাইন পোর্টাল যেখানে আপনি আপনার প্রয়োজনীয় পণ্য সামগ্রী অর্ডার করে হোম ডেলিভারি নিতে পারেন।</p>\r\n\r\n<p>&nbsp;bangoshop.com ওয়েব পোর্টালে আপনাকে স্বাগতম। এখনই দরকার (ekhonoidorkar.com)নির্ধারিত কিছু শর্তাবলী সাপেক্ষে ekhondorkar.com ওয়েবসাইটে মোবাইল অ্যাপ্লিকেশন/ অ্যাপ বা অন্য কোন মিডিয়া ওয়েবসাইট এর মাধ্যমে প্রবেশের অনুমতি দেয়। প্রদত্ত শর্তাবলী দ্বারা সম্মত হয়ে আপনি নিবন্ধিত অথবা অতিথি গ্রাহক হিসেবে এই পোর্টালটি ব্যবহার করতে পারবেন। আপনি এই শর্তাবলী দ্বারা সম্মত হয়ে নিয়মিত পোর্টালটি ব্যবহার করার জন্য প্রদত্ত শর্তাবলী মনোযোগ সহকারে পড়ুন। যদি গ্রাহক প্রদত্ত শর্তাবলী দ্বারা সম্মত না হন তাহলে এই পোর্টালটি&nbsp; সাবস্ক্রাইব এবং ব্যবহার থেকে বিরত থাকুন।</p>\r\n\r\n<p>এই পোর্টালটি কোনরকম পূর্ব ঘোষণা ছাড়াই যেকোনো সময় শর্তাদি অথবা শর্তাবলীর অংশবিশেষ পরিবর্তন, সংশোধন, সংযোজন, অপসারণের অধিকার রাখে। কোনো পূর্ব ঘোষণা ছাড়াই পরিবর্তনগুলো পোস্ট করা হবে। পরিবর্তিত শর্তাদি জানার জন্য নিয়মিত পোর্টালে নজর রাখুন। এই পরিবর্তিত শর্তাবলীর নিয়মিত ব্যবহারের ভিত্তিতে গ্রাহকের কাছে পোর্টালটির গ্রহণযোগ্যতা যাচাই করা হবে।</p>\r\n\r\n<p>ক) এই শর্তে &quot;আপনি&quot; অথবা &quot;ব্যবহারকারী&quot; দ্বারা পোর্টালটির সকল সেবার প্রকৃত ব্যবহারকারী অথবা গ্রাহককে বোঝায়। &quot;পোর্টাল&quot;, &quot;এখনি দরকার&quot; ,&quot;bangoshop.com&quot; ,&quot;আমরা&quot;,&quot; আমাদের&quot; দ্বারা সেবাদানকারী অথবা পোর্টাল অথবা এখনি দরকার ওয়েবসাইটকে বোঝায়।</p>\r\n\r\n<p>খ) এখানে বর্ণিত বিষয়বস্তু (তথ্য ও যোগাযোগ প্রযুক্তি আইন ২০০৬) এর অধীনে গঠিত যা একটি বৈদ্যুতিক রেকর্ড হিসেবে সংরক্ষণ করা হয়েছে এবং প্রয়োজনানুযায়ী সংশোধন ও প্রয়োগ করা হবে। এই দলিল ব্যবহারকারী এবং পোর্টাল এর মধ্যে একটি বৈধ ও বাধ্যতামূলক চুক্তি গঠন করে যাতে কোন সরাসরি বা ডিজিটাল স্বাক্ষরের প্রয়োজন নেই।</p>\r\n\r\n<p>গ) এই পোর্টালটিতে অন্যান্য ওয়েব সাইটগুলির লিংক থাকতে পারে, যা এখনি দরকার দ্বারা পরিচালিত হয় না এবং লিখিত সাইটগুলিতে এখনি দরকার কোন নিয়ন্ত্রন রাখেনা এবং গ্রাহকের ব্যবহার থেকে উদ্ভূত কোন ক্ষতি বা ক্ষতির&nbsp; দায় স্বীকার করেনা। সেক্ষেত্রে অন্যান্য লিংকযুক্ত পোর্টালগুলি ব্যবহারের পূর্বে প্রদত্ত শর্তাবলী মেনে ওই পোর্টাল গুলি ব্যবহার করতে হবে।</p>\r\n\r\n<p><strong>নিবন্ধন পদ্ধতি:</strong></p>\r\n\r\n<p>গ্রাহক অবশ্যই পোর্টালটিতে গ্রাহক নিবন্ধন পদ্ধতি সম্পন্ন করে যেকোন পণ্যের অর্ডার করবেন।</p>\r\n\r\n<p>গ্রাহকের একাধিক সক্রিয় একাউন্ট থাকতে পারবে না এবং গ্রাহকের একাউন্টটি হস্তান্তরযোগ্য নয় । গ্রাহক পোর্টালের মাধ্যমে যেকোনো সময় তার অ্যাকাউন্ট আপডেট, সম্পাদনা এবং বন্ধ করতে পারেন। পণ্য সরবরাহের যে কোন ঠিকানায় দুইয়ের অধিক সক্রিয় একাউন্ট গ্রহণযোগ্য নয়।</p>\r\n\r\n<p>এই পোর্টালে প্রবেশ করার জন্য&nbsp; অথবা একাউন্ট তৈরীর জন্য গ্রাহক যদি তার কর্মক্ষেত্রের ইমেইল একাউন্ট ব্যবহারের জন্য বেছে নেন, তবে তার ইমেইল একাউন্ট এবং&nbsp; কর্মক্ষেত্রের সুবিধাগুলি ব্যবহারের ক্ষেত্রে প্রযোজ্য বিধি, নীতিমালা বা প্রটোকলগুলি মেনে চলেছেন তা নিশ্চিত করার জন্য গ্রাহক সম্পূর্ণ দায়বদ্ধ।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>পণ্যের অর্ডার পদ্ধতি:</strong></p>\r\n\r\n<p>গ্রাহক তার পণ্যগুলি নির্বাচন করে পোর্টালের মাধ্যমে অর্ডার করতে পারেন। পোর্টালে প্রত্যেকটি পণ্যের সাথে মূল্য (পণ্য সরবরাহ ও অন্যান্য চার্জ এবং ট্যাক্স সহ ) দেয়া আছে। গ্রাহক তার অর্ডার করা পণ্যটি গ্রহণ করার সময় পণ্যের সাথে সংযোজিত মূল্য (পণ্য সরবরাহ ও অন্যান্য চার্জ এবং ট্যাক্স সহ ) পরিশোধ করবেন। পোর্টালে গ্রাহকের অর্ডার নিশ্চিতকরণ ও আরো অতিরিক্ত কিছু তথ্য সংগ্রহের জন্য গ্রাহকের&nbsp; সাথে যোগাযোগ করা হবে। আমাদেরকে নির্ভুল এবং সম্পূর্ণ বিবরণ সরবরাহ করে অর্ডারটি নিশ্চিত করতে সাহায্য করবেন।</p>\r\n\r\n<p><strong>বাতিলকরণ নীতি:</strong></p>\r\n\r\n<p>পোর্টালটি গ্রাহকের অর্ডার নিম্নে উল্লেখিত কারণে গ্রহণ অথবা বাতিলের অধিকার সংরক্ষণ করে। গ্রাহকের অর্ডার করা পণ্যটি যদি সহজলভ্য না হয়।&nbsp;পোর্টালে দেয়া পণ্যের মূল্য অথবা পণ্যের বিবরণে কোনো ত্রুটি থাকলে। গ্রাহকের অর্ডারে যদি কোনো ত্রুটি থাকে।কোন কারন&nbsp; ছাড়াই আমরা অর্ডার বাতিল করার অধিকার সংরক্ষণ করি। কোন নোটিশ অথবা কারণ ছাড়া ব্যবহারকারীর একাউন্ট স্থগিত বা অপসারণ করার অধিকার আমাদের রয়েছে। যেকোনো অযাচাইকৃত অর্ডার ৬ (ছয়)&nbsp; ঘন্টা পর্যন্ত রাখা হবে এবং যাচাই করার জন্য বেশ কয়েকটি প্রচেষ্টা চালানো হবে। যদি কোনো প্রতিক্রিয়া পাওয়া না যায়, সে সময়ের পরে অর্ডারটি স্বয়ংক্রিয়ভাবে বাতিল হয়ে যাবে।</p>\r\n\r\n<p><strong>পণ্য সরবরাহ পদ্ধতি:</strong></p>\r\n\r\n<p>আমরা পোর্টালের মাধ্যমে অর্ডার করা পণ্যগুলি শুধুমাত্র আমাদের নির্ধারিত সরবরাহের স্থানে পৌঁছে দিব। গ্রাহক আমাদের পোর্টালে পণ্য সরবরাহের নিয়ম এবং সরবরাহের সময় সম্পর্কে আরো বিস্তারিত তথ্য পেতে পারেন। আমরা গ্রাহকের অর্ডার করা পণ্যগুলি প্রদত্ত ঠিকানায় প্রধান ফটকের সামনে সরবরাহ করব। আমাদের কর্মী পণ্য সরবরাহের জন্য গ্রাহকের প্রধান ফটকের ভেতরে প্রবেশ করবে না। আপনার পরিবর্তে আপনার কোন প্রতিনিধি যদি পণ্য সংগ্রহ করে তাহলে সেই ব্যক্তিকে অবশ্যই তার পরিচয়ের প্রমাণ দিতে হবে ।</p>\r\n\r\n<p><strong>পণ্য ফেরত দেয়ার নীতিমালা:</strong></p>\r\n\r\n<p><strong>পণ্য সরবরাহের সময় গ্রাহক পণ্য ফেরত দিতে পারে</strong></p>\r\n\r\n<p><strong>যদি:</strong></p>\r\n\r\n<p>ক) পণ্য যদি গ্রাহকের মনঃপুত না হয়।</p>\r\n\r\n<p>খ) পণ্য সরবরাহের সময় ক্ষতিগ্রস্ত অবস্থায় পাওয়া যায়।</p>\r\n\r\n<p>গ) পণ্যের গুণগত মান এবং পরিমাণ সম্পর্কে সন্দেহ থাকলে।</p>\r\n\r\n<p>ঘ) পণ্য অস্বাস্থ্যকর/ অপ্রত্যাশিত অবস্থায় প্রাপ্ত হলে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>প্রত্যর্পণ নীতিঃ</strong></p>\r\n\r\n<p>যদি আপনি কোন পণ্যের&nbsp; অর্ডার দিয়ে অনলাইনে প্রি-পেমেন্ট বা কার্ডের মাধ্যমে অর্থ প্রদান করে থাকেন এবং পরবর্তীতে সেই পণ্য গুলো যদি আমদের স্টকে না থাকে ,তাহলে আমরা আপনাকে ঐ একই দামের মধ্যে বিকল্প পণ্য সরবরাহ করার প্রস্তাব দিব। যদি কোনও কারণে আপনি বিকল্প পণ্য গ্রহণ করতে অস্বীকার করেন তবে অর্ডার বাতিল হয়ে যাবে এবং আমরা আপনার অর্থ ফেরত দেয়ার প্রক্রিয়া শুরু করব। দয়া করে আমাদের গ্রাহক সেবা দানকারী কে +৮৮০১৪০৪৪৫৮৬৬৮ নম্বরে কল করে আপনার পণ্য ফেরতের অনুরোধটি নিশ্চিত করে নিন (প্রতিদিন সকাল ৯ টা থেকে রাত ৮ টা অবধি)। &ldquo;এখনি দরকার &rdquo; আপনার কাছে ব্যাংক বা বিকাশ বা অন্যান্য মাধ্যমের চার্জগুলি কেটে দেওয়ার পরে রিফান্ড পেমেন্টের মাধ্যমের পুরো অধিকার ধরে রাখবে। অর্থ ফেরতের প্রক্রিয়াটি সাধারণত ফেরতের অনুরোধের তারিখ থেকে প্রায় ১০ থেকে ১৫ ব্যাংকিং দিন সময় নেয়।এর অর্থ হচ্ছে আপনি আমাদের গ্রাহক সেবা দানকারী হেল্পলাইনের মাধ্যমে অর্থ ফেরতের অনুরোধ জানানোর ১৫ ব্যাংকিং দিনের মধ্যে আপনার অর্থ বুঝে পাবেন।</p>\r\n\r\n<p><strong>&nbsp;কুকিজঃ</strong></p>\r\n\r\n<p>এই সাইটটি কুকিজ ব্যবহার করে, যার অর্থ এই সাইটের সমস্ত কার্যকারিতা সঠিকভাবে&nbsp; করার জন্য আপনার কম্পিউটারে কুকিজ&nbsp; সচল&nbsp; থাকতে হবে। কুকি হচ্ছে একটি ছোট ডেটা ফাইল যা&nbsp; আপনার হার্ড ড্রাইভে লেখা হয় যখন আপনি নির্দিষ্ট ওয়েবসাইটগুলি পরিদর্শন করেন । কুকি ফাইলগুলিতে নির্দিষ্ট তথ্য থাকে, যেমন একটি এলোমেলো নম্বর ব্যবহারকারী আইডি,যা সাইটটির পরিদর্শনকৃত পৃষ্ঠাগুলি ট্র্যাক করার জন্য একজন দর্শনার্থীকে নির্ধারিত করে। একটি কুকি আপনার হার্ড ডিস্কের বাইরের ডেটা পড়তে বা অন্য সাইটগুলির দ্বারা তৈরি কুকি ফাইলগুলি পড়তে পারে না। কুকিজ, নিজেদের দ্বারা, কোনও ব্যবহারকারীর পরিচয় সনাক্ত করতে ব্যবহার করা যাবে না।</p>\r\n\r\n<p><strong>কপিরাইট</strong></p>\r\n\r\n<p>ক) &ldquo;এখনি দরকার&rdquo; - এ&nbsp; থাকা উপাদান (বিষয়বস্তু এবং অন্য কোন বিষয়বস্তু, সফ্টওয়্যার বা সেবাসমূহ) হল &ldquo;এখনি দরকার&rdquo; এর সহযোগী সংস্থা, অনুমোদিত এবং তৃতীয় পক্ষের লাইসেন্সদাতাদের সম্পত্তি। &ldquo;এখনি দরকার&rdquo; এর লিখিত অনুমতি ব্যতীত এই সাইটের কোনও উপাদান অনুলিপি, পুনরায় উৎপাদন , পুনঃপ্রকাশ, ইনস্টল, পোস্ট, সঞ্চারিত, সঞ্চিত বা বিতরণ করা যাবে না। আপনি ওয়েবসাইটের মাধ্যমে&nbsp; প্রবেশ, অর্জন, অনুলিপি বা&nbsp; ওয়েবসাইট এর কোন অংশ মনিটর বা কোন&nbsp; বিষয়বস্তু বা পুনরায় উৎপাদনের কোন পন্থা বা নেভিগেশনাল কাঠামোর পরিবেষ্টন করা বা ওয়েবসাইট বর্ণনা&nbsp; বা এমন&nbsp; বিষয়বস্তু&nbsp; যা উদ্দেশ্যমূলকভাবে&nbsp; নয়&nbsp; যেমন&nbsp; উপকরণ,নথি বা তথ্য &nbsp; অর্জন করার চেষ্টা করা ইত্যাদির জন্য কোনও &quot;গভীর-লিঙ্ক&quot;, &quot;পৃষ্ঠা-পরিষ্কার &quot;, &quot;রোবট&quot;, &quot;স্পাইডার&quot; বা অন্যান্য স্বয়ংক্রিয় ডিভাইস, প্রোগ্রাম, অ্যালগরিদম বা পদ্ধতি বা কোনও অনুরূপ বা সমতুল্য ম্যানুয়াল প্রক্রিয়া ব্যবহার করতে পারবেন না&nbsp; । আমরা এই জাতীয় কোনও ক্রিয়াকলাপ নিষিদ্ধ করার অধিকার রাখি।</p>');
