(252, 78, 1, NULL, 9, 'Dabur Amla Hair Oil', 'ডাবর আমলা হেয়ার অয়েল', 'Is pollution and constant use of hair products making your hair dull? You need Dabur Amla Hair Oil. It strengthens your hair from within, encourages fresh growth and controls pre-mature greying. Dabur Amla Hair Oil nourishes the scalp and strengthens the hair strands, from root to tip, to give you thick, long & shiny tresses.', 'দূষণ এবং চুলের পণ্যগুলির অবিচ্ছিন্ন ব্যবহার কি আপনার চুলকে নিস্তেজ করে তোলে? আপনার ডাবর আমলা হেয়ার অয়েল দরকার। এটি আপনার চুলকে অভ্যন্তর থেকে শক্তিশালী করে, সতেজ বৃদ্ধির উৎসাহ যোগায় এবং প্রাক-পরিপক্ক বৃদ্ধি  নিয়ন্ত্রণ করে। ডাবর আমলা হেয়ার অয়েল চুলের ত্বকে পুষ্টি জোগায় এবং চুলের স্ট্র্যান্ডকে মূল থেকে ডগা পর্যন্ত শক্তিশালী করে, আপনাকে ঘন, লম্বা এবং চকচকে বেণী প্রদান করে।', 'assets/images/products/1597510742dabur-amla-hair-oil.png', '295', '২৯৫', 450, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-15 20:59:02', '2020-10-15 04:48:22', 0, 0, 'Dabur-Amla-Hair-Oil-450ml', '0.00'),
