(268, 78, 1, NULL, 9, 'Dabur Almond Hair Oil', 'ডাবর অ্যালমন্ড হেয়ার অয়েল', 'Perming? Colouring? Straightening? Fret not, wear a hairstyle that suits your mood, because we’ll take care of the damage. The wholesome goodness of almond protein when combined with the nourishing power of 2x vitamin E, makes Dabur Almond Hair Oil non-sticky and light, and keeps your hair gorgeous and damage-free.', 'পার্মিং? শোভা? সোজা? হতাশ হবেন না, এমন একটি চুলের স্টাইল করুন যা আপনার মনের জন্য উপযুক্ত, কারণ আমরা এর ক্ষতির যত্ন নেব। ২x ভিটামিন ই এর পুষ্টিকর শক্তির সাথে মিলিত হয়ে বাদাম প্রোটিনের সুস্বাদু ধার্মিকতা ডাবর অ্যালমন্ড হেয়ার অয়েলকে নন-স্টিকি এবং হালকা করে তোলে এবং আপনার চুলকে দৃষ্টিনন্দন এবং ক্ষতি-মুক্ত রাখে।', 'assets/images/products/1597569433dabur-almond-hair-oil.png', '110', '১১০', 100, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-16 13:17:14', '2020-10-15 04:48:22', 0, 0, 'Dabur-Almond-Hair-Oil', '0.00'),
