(276, 78, 1, NULL, 9, 'Vatika Premium Naturals Lemon & Tea Tree Oil Anti Dandruff Shampoo', 'ভাটিকা প্রিমিয়াম ন্যাচারালস লেমন এন্ড টি ট্রি অয়েল অ্যান্টি ড্যানড্রফ শম্পু', 'Get dandruff-free, beautiful hair with the new Dabur Vatika Naturals Anti Dandruff Shampoo. Vatika Premium Naturals Anti Dandruff Shampoo has the goodness of Seven Natural Ingredients - Lemon, Tea tree oil, Fenugreek, Henna, Almond, Rosemary & Aloevera that helps get rid of 100 % dandruff from the hair and scalp from the first wash and gives great looking hair.Enriched with the goodness of nature, Vatika gently removes dandruff and prevents recurrence, without causing any damage to hair.', 'নতুন ডাবর ভাটিকা ন্যাচারালস অ্যান্টি ড্যানড্র্ফ শ্যাম্পুর সাথে পাচ্ছেন খুশকামুক্ত ও সুন্দর চুল। ভাটিকা প্রিমিয়াম ন্যাচারালস অ্যান্টি ড্যানড্রফ শ্যাম্পুতে রয়েছে সাতটি প্রাকৃতিক উপাদান - লেবু, চা গাছের তেল, মেথি, হেনা, বাদাম, রোজমেরি এবং অ্যালোভেরা যা প্রথম ধোয়া থেকে চুল এবং মাথার ত্বক থেকে ১০০% খুশকি থেকে মুক্তি পেতে সহায়তা করে এবং দুর্দান্ত চুল উপহার দেয়। প্রকৃতির ধার্মিকতায় সমৃদ্ধ, ভাটিকা ধীরে ধীরে খুশকি মুক্ত করে এবং চুলের কোনও ক্ষতি না করে পুনরাবৃত্তি প্রতিরোধ করে।', 'assets/images/products/1597574202lemon-and-tea-tree-oil-shampoo.png', '95', '৯৫', 100, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-16 14:36:42', '2020-10-15 04:48:22', 0, 0, 'Vatika-Premium-Naturals-Lemon-Tea-Tree-Oil-Anti-Dandruff-Shampoo', '0.00'),
