(467, 78, 105, NULL, 2, 'Clear Shampoo Anti Hairfall Anti Dandruff', 'ক্লিয়ার শ্যাম্পু এন্টি হেয়ারফল এন্টি  ডেন্ড্রাফ', 'This shampoo contains proven nutrium oil complex technique that efficiently caters to your scalp & hair needs at all levels.Frees the scalp from dandruff & ensures up to 95% less hair fall.It eliminates dandruff and reduces grease,relieves your scalp from itching.Gently cleanses and nourishes the scalp while leaving hair soft and shiny.For best results use at least twice a week.', 'এই শ্যাম্পুতে প্রমাণিত পুষ্টিগুণ  রয়েছে যা দক্ষতার সাথে আপনার মাথার ত্বক এবং চুলের সমস্ত স্তরের প্রয়োজনের জন্য দক্ষতার সাথে পরিশ্রম করে মাথার ত্বক খুশকির হাত থেকে মুক্ত করে এবং চুলের 95% কম পড়ে তা নিশ্চিত করে  এটি খুশকি দূর করে এবং গ্রীস হ্রাস করে, আপনার চুলকানি  থেকে মুক্তি দেয় , চুল নরম এবং চকচকে রেখে মাথার ত্বককে পরিষ্কার করে এবং পুষ্ট করে ।সর্বোত্তম ফলাফল সপ্তাহে কমপক্ষে দু\'বার ব্যবহার করুন।', 'assets/images/products/1616311772anti hair 350.PNG', '340', '৩৪০', 350, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 21:26:15', '2021-03-21 07:29:32', 0, 0, 'Clear-Shampoo-Anti-Hairfall-Anti-Dandruff-350ml', '0.00'),
(468, 78, 105, NULL, 2, 'Clear Shampoo Complete Active Care Anti Dandruff', 'ক্লিয়ার কমপ্লিট অ্যাক্টিভ কেয়ার এন্টি  ডেন্ড্রাফ', 'The Clear Complete Active Care Shampoo provides a complete solution to give a smoothing effect to rough and dry hair. Regular application of this shampoo replenishes protein components, nourishes scalp, softens and nourishes the hair, fights dandruff and avoids its recurrence, thus keeping your scalp healthy. You hair will feel soft, silky and beautiful after every wash,  you\'ll see no visible flakes! Effective and gentle so it can be used daily to end recurring dandruff for good.', 'ক্লিয়ার কমপ্লিট অ্যাক্টিভ কেয়ার শ্যাম্পু রুক্ষ এবং শুকনো চুলগুলিতে একটি স্মুথিং এফেক্ট দেয় । এই শ্যাম্পুর নিয়মিত প্রয়োগ প্রোটিন উপাদানগুলিকে পরিপূর্ণ করে, মাথার ত্বকে পুষ্টি জোগায়, চুলকে নরম করে এবং পুষ্টি জোগায়, খুশির সাথে লড়াই করে এবং এর পুনরাবৃত্তি এড়ায়, এইভাবে আপনার মাথার ত্বক সুস্থ রাখে। আপনার চুল প্রতিটি ধোয়া পরে নরম, সিল্কি এবং সুন্দর বোধ করবে, আপনি কোনও দৃশ্যমান ফ্লেক্স দেখতে পাবেন না ।', 'assets/images/products/1616311907active care.PNG', '200', '২০০', 180, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 21:34:49', '2021-03-21 07:31:47', 0, 0, 'Clear-Shampoo-Complete-Active-Care-Anti-Dandruff-180  ml', '0.00'),
