(471, 78, 105, NULL, 2, 'Clear Shampoo Men Cool Sport Menthol Anti Dandruff', 'ক্লিয়ার  শ্যাম্পু ম্যান কুল স্পোর্ট মেন্থলএন্টি  ডেন্ড্রাফ', 'This shampoo is formulated specially for men as men\'s scalp is more prone to Dandruff to fight its causes. With cooling mint & menthol to refresh and energise the scalp. With effective Tripple Anti-Dandruff Technology formulation for lasting Dandruff Protection for men.', 'এই শ্যাম্পুটি পুরুষদের জন্য বিশেষভাবে তৈরি করা হয় কারণ পুরুষদের মাথার ত্বকে খুশকির কারণগুলির সাথে লড়াই করার ঝুঁকি বেশি থাকে। মাথার ত্বককে রিফ্রেশ এবং শক্তিশালী করতে পুদিনা ও মেন্থল শীতল করে। পুরুষদের জন্য দীর্ঘস্থায়ী খুশকি সুরক্ষার জন্য কার্যকর ট্রিপল অ্যান্টি-ড্যানড্রফ প্রযুক্তি গঠনের মাধ্যমে এটি তৈরি করা হয় ।', 'assets/images/products/1616312063men cool 180.PNG', '240', '২৪০', 180, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 21:46:22', '2021-03-21 07:34:23', 0, 0, 'Clear-Shampoo-Men-Cool-Sport-Menthol-Anti-Dandruff-180 ml', '0.00'),
