(473, 78, 105, NULL, 2, 'Clear Shampoo Soft & Shiny Anti Dandruff', 'ক্লিয়ার  শ্যাম্পু সফ্ট অ্যান্ড শাইনি এন্টি  ডেন্ড্রাফ', 'CLEAR Soft & Shiny Anti Dandruff Shampoo removes tangles and makes your hair upto 4X softer. Formulated with Nutrium 10, a rich blend of 10 nutrients and botanical actives, it activates your scalp\'s natural protection layer, keeping you dandruff-proof.With a fresh and invigorating scent,CLEAR Soft & Shiny Anti Dandruff Shampoo alleviates itchy, flaky scalp and shields the scalp and hair against the recurring of intensive hair damage.', 'ক্লিয়ার নরম এবং চকচকে অ্যান্টি ড্যানড্রফ শ্যাম্পু ট্যাঙ্গেলগুলি সরিয়ে দেয় এবং আপনার চুল নরম করে তোলে।১০ টি  পুষ্টি এবং বোটানিকাল অ্যাকটিভের সমৃদ্ধ মিশ্রিত পুষ্টি, নিউট্রিয়াম ১০ দিয়ে সূচিত, এটি আপনার মাথার ত্বকের প্রাকৃতিক সুরক্ষা স্তরকে সক্রিয় করে, আপনাকে খুশকিবিহীন রাখে একটি তাজা এবং সুগন্ধের সাথে, ক্লিয়ার নরম এবং চকচকে। এন্টি খুশকি শাম্পু চুলকানি, ফ্ল্যাচি স্ক্যাল্প দূর করে চুল ক্ষতি পুনরাবৃত্তির বিরুদ্ধে মাথার ত্বক ও চুলকে বিরত রাখে।', 'assets/images/products/1616312198soft and shiny 375.PNG', '310', '৩১০', 375, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 21:57:41', '2021-03-21 07:36:38', 0, 0, 'Clear-Shampoo-Soft-Shiny-Anti-Dandruff-375 ml', '0.00'),
(474, 78, 105, NULL, 2, 'Clinic Plus Shampoo Strong and Long', 'ক্লিনিক প্লাস  শ্যাম্পু স্ট্রং এন্ড  লং', 'Clinic Plus strong and long health shampoo with the goodness of milk protein makes your hair stronger. Its advanced milk protein formula contains an essential protein element which body cannot produce. This essential protein penetrates into each hair strand providing nourishment every time you wash your hair with Clinic Plus shampoo. For best results wash your hair daily with Clinic Plus strong and long health shampoo. Use Clinic Plus conditioner every time you shampoo for soft and silky hair.', 'শক্তিশালী এবং দীর্ঘ স্বাস্থ্যের ক্লিনিক প্লাস শ্যাম্পু সদ্ব্যবহারের সাথে আপনার চুল শক্তিশালী করে তোলে। এর উন্নত দুধের প্রোটিন সূত্রে একটি প্রয়োজনীয় প্রোটিন উপাদান রয়েছে যা শরীর উৎপাদন করতে পারে না। এই ক্লিনিক প্লাস শ্যাম্পুর সাহায্যে প্রতিবার চুল ধুলে পুষ্টি সরবরাহের জন্য প্রতিটি চুলের স্ট্র্যান্ডে এই প্রয়োজনীয় প্রোটিন প্রবেশ করে। সেরা ফলাফলের জন্য আপনার ক্লিনিক প্লাস শক্তিশালী এবং দীর্ঘস্বাস্থ্যের শ্যাম্পু দিয়ে প্রতিদিন চুল ধুয়ে নিন। প্রতিবার নরম এবং সিল্কি চুলের জন্য শ্যাম্পু করুন এবং ক্লিনিক প্লাস কন্ডিশনার ব্যবহার করুন।', 'assets/images/products/1616312489clinic 170.PNG', '150', '১৫০', 170, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 22:08:03', '2021-03-21 07:41:29', 0, 0, 'Clinic-Plus-Shampoo-Strong-and-Long-170 ml', '0.00'),
