(477, 79, 1, NULL, 2, 'Closeup Toothpaste Menthol Fresh', 'ক্লোজআপ টুথপেস্ট মেন্থল ফ্রেশ', 'With fresher breath, get the confidence to get up close for intense moments of closeness. Infused with antibacterial mouthwash formula to give you longer lasting fresh breath. Enjoy the refreshing burst of fresh flavor from Closeup Ever Fresh gel toothpaste.', 'নতুন শ্বাসের সাথে, তীব্র মুহুর্তের ঘনিষ্ঠ হওয়ার জন্য আত্মবিশ্বাস পান। আপনাকে দীর্ঘস্থায়ী তাজা শ্বাস দেওয়ার জন্য অ্যান্টিব্যাকটেরিয়াল মাউথওয়াশ সূত্রটি দিয়ে তৈরি । ক্লোজআপ এভার ফ্রেশ জেল টুথপেস্ট থেকে টাটকা স্বাদে সতেজ  উপভোগ করুন।', 'assets/images/products/1616312737close up menthol 100 g.PNG', '85', '৮৫', 100, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-22 22:22:51', '2021-05-17 06:52:30', 1, 0, 'Closeup-Toothpaste-Menthol-Fresh-100 g', '0.00'),
(478, 93, 1, NULL, 21, 'Pure Turmeric Powder', 'পিওর হলুদ গুঁড়ো', 'Apart from having excellent antiseptic and antibacterial properties, it has the distinct flavor and fragrance of coriander for your delicious preparations.', 'চমৎকার এন্টিসেপটিক এবং অ্যান্টিব্যাকটিরিয়াল বৈশিষ্ট্যগুলি ছাড়াও এটি আপনার সুস্বাদু প্রস্তুতির জন্য ধনিয়া স্বাদ এবং সুগন্ধযুক্ত রয়েছে।', 'assets/images/products/1598120816ACI Turmeric Powder.jpg', '8', '৮', 15, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-22 22:26:56', '2020-10-15 04:48:23', 0, 0, 'Pure-Turmeric-Powder', '0.00'),
