(480, 79, 1, NULL, 2, 'Closeup Toothpaste Red Hot', 'ক্লোজআপ টুথপেস্ট রেড হট', 'Closeup Red Hot helps you get upto 12 hours of fresh breath. This shiny gel infused with active zinc mouthwash helps you get the best sparkling white smile. Active Zinc Mouthwash cleans deep corners of your mouth of germs, which hasty brushing often misses. Let nothing stop you from getting close to the one you desire.', 'ক্লোজআপ রেড হট আপনাকে 12 ঘন্টা পর্যন্ত তাজা শ্বাস নিতে সহায়তা করে। এই চকচকে জেলটি সক্রিয় দস্তা মাউথওয়াশের সাথে সংক্রামিত হয়েছে আপনাকে সেরা চমকপ্রদ সাদা হাসি পেতে সহায়তা করে। অ্যাক্টিভ জিঙ্ক মাউথওয়াশ আপনার জীবাণুর মুখের গভীর কোণগুলি পরিষ্কার করে, যা তাড়াহুড়ো করা ব্রাশ প্রায়শই মিস করে। আপনার ইচ্ছার কাছাকাছি আসতে কোনও কিছুই যেন বাধা না দেয়।', 'assets/images/products/1620120866Closeup Toothpaste Red Hot 145 gm.png', '110', '১১০', 145, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 22:32:38', '2021-05-04 09:34:26', 0, 0, 'Closeup-Toothpaste-Red-Hot-145 g', '0.00'),
(481, 79, 105, NULL, 2, 'Closeup Toothpaste White Attraction Natural Smile', 'ক্লোজআপ টুথপেস্ট হোয়াইট এট্ট্রাকশন ন্যাচারাল  স্মাইল', 'This gel toothpaste is infused with a natural blend of sea salt and vibrant lemon and helps you get whiter teeth. It gently polishes and removes stains from teeth to reveal your white smile. Combined with intensely fresh lemon flabour of Closeup, your smile has everything that it needs.', 'এই জেল টুথপেষ্ট সামুদ্রিক লবণ এবং প্রাণবন্ত লেবুর একটি প্রাকৃতিক মিশ্রণ সঙ্গে মিশ্রিত করা হয় এবং আপনাকে সাদা দাঁত পেতে সাহায্য করে। এটি আপনার সাদা হাসি ফুটিয়ে তুলতে আস্তে আস্তে পোলিশ করে দাঁত থেকে দাগ দূর করে। ক্লোজআপের তীব্র তাজা লেবু ফ্লাবরের সাথে একত্রিত, আপনার হাসির যা প্রয়োজন তা সবই আছে।', 'assets/images/products/1616313311natural smile 80.PNG', '80', '৮০', 80, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-22 22:42:34', '2021-03-21 07:55:11', 0, 0, 'Closeup-Toothpaste-White-Attraction-Natural-Smile-80 g', '0.00'),
(482, 79, 105, NULL, 2, 'Closeup Toothpaste White Attraction Nature Rush', 'ক্লোজআপ টুথপেস্ট  হোয়াইট  এট্ট্রাকশন ন্যাচারাল রাশ', NULL, NULL, 'assets/images/products/1616313357natural rush 80.PNG', '80', '৮০', 80, 'g', NULL, NULL, NULL, 1, 0, '2020-08-22 22:47:40', '2021-03-21 07:55:57', 0, 0, 'Closeup-Toothpaste-White-Attraction-Nature-Rush- 80 g', '0.00'),
