(485, 69, 1, NULL, 2, 'Domex Toilet Cleaning Liquid Lime Fresh 500ml', 'ডোমেক্স টয়লেট ক্লিনিং লিকুইড লাইম ফ্রেশ', 'Domex Fresh and Clean is a powerful toilet cleaning liquid that gives you 2 times long lasting freshness. Its thick formula helps it spread across the toilet bowl and helps in effortless cleaning. Its unique colour changing technology turns the product from green to blue when in contact with water. Its powerful cleaning agents remove the toughest stains and provide germ protection.', 'ডোমেক্স ফ্রেশ এবং ক্লিন একটি শক্তিশালী টয়লেট পরিষ্কারের তরল যা আপনাকে 2 গুণ দীর্ঘস্থায়ী সতেজতা  দেয়। এটির ঘন সূত্র এটি টয়লেটের বাটি জুড়ে ছড়িয়ে দিতে এবং অনায়াসে পরিষ্কারে সহায়তা করে। জলের সংস্পর্শে আসার সময় এর অনন্য রঙ পরিবর্তনের প্রযুক্তি পণ্যটিকে সবুজ থেকে নীল করে তোলে। এর শক্তিশালী পরিষ্কার পরিচ্ছন্নতার এজেন্টরা সবচেয়ে শক্ত দাগ সরিয়ে জীবাণু সুরক্ষা সরবরাহ করে।', 'assets/images/products/1620121635Domex-Toilet-Cleaning-Liquid-Lime-Fresh-500ml.png', '100', '১০০', 500, 'ml', NULL, NULL, 5, 1, 0, '2020-08-22 23:12:30', '2021-05-04 09:47:15', 0, 0, 'Domex-Toilet-Cleaning-Liquid-Lime-Fresh-500ml', '0.00'),
