(487, 77, 1, NULL, 2, 'Dove Beauty Bar Pink', 'ডাভ  বিউটি  বার  পিঙ্ক', 'DOVE Pink Beauty Bar combines a gentle cleansing formula with DOVE’s signature ¼ moisturizing cream to give you softer, smoother and more glowing skin. This DOVE bar even helps to replenish nutrients that are lost during the cleansing process - where a regular soap bar might leave your skin feeling dry and tight, a DOVE Pink Bar leaves it feeling soft and smooth. It’s not a soap – it’s a beauty bar Washing with regular soap can cause skin to feel dry, tight and irritated as some cleansing ingredients strip skin of essential nutrients.', 'ডাভ গোলাপী বিউটি বার আপনাকে নরম, মসৃণ এবং আরও ঝলমলে ত্বক দেওয়ার জন্য ডাভ  এর স্বাক্ষর ¼ ময়শ্চারাইজিং ক্রিমের সাথে একটি মৃদু সাফ করার সূত্র একত্রিত করে। এই ডাভ বার এমনকি পরিষ্কারের প্রক্রিয়া চলাকালীন হারিয়ে যাওয়া পুষ্টি পুনরায় পূরণ করতে সহায়তা করে - যেখানে নিয়মিত সাবান বারটি আপনার ত্বককে শুষ্ক ও টান অনুভব করতে পারে, সেখানে একটি ডোভ গোলাপী বার এটিকে নরম এবং মসৃণ বোধ করে।', 'assets/images/products/1620122287Dove-Beauty-Bar-Pink-100gm.png', '75', '৭৫', 100, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-22 23:22:40', '2021-05-04 09:58:07', 0, 0, 'Dove-Beauty-Bar-Pink', '0.00'),
