(491, 78, 1, NULL, 2, 'Dove Conditioner Environmental Defense', 'ডাভ কন্ডিশনার  এনভায়রনমেন্টাল ডিফেন্স', 'Dove Environmental Defence conditioner helps reverse upto 100% of pollution damage in hair. For best results, use Dove Environmental Defence Shampoo with every wash', 'ডাভ  এনভায়রনমেন্টাল ডিফেন্স কন্ডিশনার চুলের দূষণ ক্ষতির 100% পর্যন্ত বিপরীত দিকে সহায়তা করে। সেরা ফলাফলের জন্য, প্রতিটি ধোয়া সহ ডাভ  এনভায়রনমেন্টাল ডিফেন্স শ্যাম্পু ব্যবহার করুন।', 'assets/images/products/1621237463Dove-IDC-180ml.png', '290', '২৯০', 180, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 23:39:02', '2021-05-17 07:44:23', 0, 0, 'Dove-Conditioner-Environmental-Defense', '0.00'),
(492, 78, 1, NULL, 2, 'Dove Conditioner Hairfall Rescue', 'ডাভ হেয়ার ফল রেসকিউ কন্ডিশনার', 'With its caring ingredients, Dove Hair Fall Rescue Conditioner is suitable for every day use and best paired with its hair fall-fighting partner', 'এর যত্নশীল উপাদানগুলির সাথে,ডাভ হেয়ার ফল রেসকিউ কন্ডিশনার প্রতিদিনের ব্যবহারের জন্য উপযুক্ত এবং চুল পড়ার লড়াইয়ের অংশীদারদের সাথে সর্বোত্তমভাবে জুটিবদ্ধ', 'assets/images/products/1620123181Dove-Conditioner-Hairfall-Rescue-180-gm.png', '270', '২৭০', 180, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 23:44:52', '2021-05-04 10:13:01', 0, 0, 'Dove-Conditioner-Hairfall-Rescue', '0.00'),
(493, 78, 1, NULL, 2, 'Dove Conditioner Intense Repair', 'ডাভ  কন্ডিশনার  ইন্টেন্স রিপেয়ার', 'Dove Intense Repair Shampoo improves your hair health. It offers unbeatable damage control and nourishes and enhances the appearance of dry and damaged hair. The Nutri-Keratin Repair Actives help repair damage from the outside and within', 'ডাভ তীব্র মেরামত শ্যাম্পু আপনার চুলের স্বাস্থ্যের উন্নতি করে। এটি অপরাজেয় ক্ষয়ক্ষতি নিয়ন্ত্রণ সরবরাহ করে এবং শুষ্ক এবং ক্ষতিগ্রস্থ চুলের চেহারা বাড়িয়ে তোলে। নিউট্রি-কেরাটিন সারাইয়ের ক্রিয়াকলাপগুলি বাইরে থেকে এবং এর মধ্যে থেকে ক্ষতি মেরামত করতে সহায়তা করে।', 'assets/images/products/1620190119Dove-Conditioner-Intense-Repair-175-ml.png', '270', '২৭০', 175, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-22 23:49:33', '2021-05-05 04:48:39', 0, 0, 'Dove-Conditioner-Intense-Repair', '0.00'),
