(558, 80, 1, NULL, 2, 'Glow and Lovely Face Cream Blemish Balm', 'গ্লো অ্যান্ড লাভলি বিবি ক্রিম', 'The Fair and Lovely BB Cream is a fairness cream with a make-up finish. This expert product brings together the benefits of foundation & advanced multivitamin fairness cream. Its suitable for all kind of skins. Use it daily to hide dark spots and blemishes, and achieve a bright and fresh look every day. You can also apply it for special occasions in place of make-up.', 'ফেয়ার অ্যান্ড লাভলি বিবি ক্রিম একটি মেক-আপ ফিনিস সহ ফেয়ারনেস ক্রিম। এই বিশেষজ্ঞ পণ্যটি ফাউন্ডেশন এবং উন্নত মাল্টিভিটামিন ফেয়ারনেস ক্রিমের সুবিধাগুলি একত্রিত করে। এটি সমস্ত ধরণের স্কিনের জন্য উপযুক্ত। দাগগুলি আড়াল করতে প্রতিদিন এটি ব্যবহার করুন এবং প্রতিদিন একটি উজ্জ্বল এবং তাজা চেহারা অর্জন করুন। আপনি এটি মেক-আপের জায়গায় বিশেষ অনুষ্ঠানের জন্য প্রয়োগ করতে পারেন।', 'assets/images/products/1620191014Glow-and-Lovely-Face-Cream-Blemish-Balm-18-gm.png', '110', '১১০', 18, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-23 23:04:24', '2021-05-05 05:03:35', 0, 0, 'Glow-and-Lovely-Face-Cream-Blemish-Balm-18gm', '0.00'),
