(561, 80, 105, NULL, 2, 'Fair And Lovely Face Wash Anti Pimple', 'ফেয়ার অ্যান্ড লাভলি ফেস ওয়াশ অ্যান্টি পিম্পল', 'Fair And Lovely Face Wash Anti Pimple fight common skin problems with the fair and lovely pimple off fairness on face wash. Fortified with the goodness of essential ingredients, the face wash smooth and brightens your skin by getting rid of pimples and acne. It reaches the deeper pores of the skin and cleanses it thoroughly. The oil control formula keeps skin nourished and supple and prevents dust and dirt from entering the pores of your skin.', 'ফেয়ার অ্যান্ড লাভলি ফেস ওয়াশ অ্যান্টি পিম্পল ত্বকের সাধারণ সমস্যাগুলির সাথে লড়াই করে। অত্যাবশ্যকীয় উপাদানের সদ্ব্যবহারের সাথে সুরক্ষিত, মুখ ধোয়া এবং ব্রণ থেকে মুক্তি পেয়ে আপনার ত্বককে মসৃণ করে এবং আলোকিত করে ।এটি ত্বকের গভীর ছিদ্রগুলিতে পৌঁছে এবং এটি পুরোপুরি পরিষ্কার করে। তেল নিয়ন্ত্রণ সূত্র ত্বককে পুষ্ট ও কোমল রাখে এবং ধুলাবালি এবং ময়লা আপনার ত্বকের ছিদ্রগুলিতে প্রবেশ করতে বাধা দেয়।', 'assets/images/products/1615714807FALAPFH100.jpg.jpg', '150', '১৫০', 100, 'g', NULL, NULL, NULL, 1, 0, '2020-08-23 23:19:30', '2021-03-14 09:40:07', 0, 0, 'Fair-And-Lovely-Face-Wash-Anti-Pimple', '0.00'),
(562, 80, 105, NULL, 2, 'Fair And Lovely Face Wash Ayurvedic', 'ফেয়ার অ্যান্ড লাভলি ফেস ওয়াশ আয়ুর্বেদিক', 'Fair And Lovely Face Wash Ayurvedic is an expert fairness face wash which is ideal for sensitive skin. Fair & Lovely ayurvedic care is just not a face wash, it’s a complete ayurvedic care for your face. Infused with the goodness of turmeric and kumkumadi tailam - Fair & Lovely ayurvedic face wash has a unique blend of 14 natural ingredients which is know to give you a glowing skin.', 'ফেয়ার অ্যান্ড লাভলি ফেস ওয়াশ আয়ুর্বেদিক একটি  বিশেষজ্ঞ ফেয়ারনেস ফেসওয়াশ যা সংবেদনশীল ত্বকের জন্য আদর্শ। ফেয়ার অ্যান্ড লাভলী আয়ুর্বেদিক  কেবল ফেস ওয়াশ নয়, এটি আপনার মুখের জন্য একটি সম্পূর্ণ আয়ুর্বেদিক যত্ন। হলুদ ও কুমকুমাদি তৈলের সচ্ছলতায় ফেয়ার অ্যান্ড লাভলী আয়ুর্বেদিক ফেস ওয়াশটিতে একটি ১৪ টি প্রাকৃতিক উপাদান দিয়ে তৈরি যা আপনাকে একটি চকচকে ত্বক দিতে পারে।', 'assets/images/products/1615714907FALAVFH100.jpg.jpg', '150', '১৫০', 100, 'g', NULL, NULL, NULL, 1, 0, '2020-08-23 23:26:25', '2021-03-14 09:41:47', 0, 0, 'Fair-And-Lovely-Face-Wash-Ayurvedic', '0.00'),
