(571, 80, 105, NULL, 2, 'Fair and Lovely Fairness Cream Ayurvedic Care', 'ফেয়ার অ্যান্ড লাভলী ফেয়ারনেস ক্রিম আয়ুর্বেদিক কেয়ার', 'Fair and Lovely Fairness Cream Ayurvedic Care is an expert fairness cream ideal for sensitive cream. Infused with the goodness of KumKumadi Tailam, Fair & Lovely Ayurvedic Care Cream has 16 ingredients which are known to give the following benefits: 1. Ingredients like Lodhra, Khas & Neelotpal calms & soothes the skin ; 2. Manjishtha, Kesar & Padmak clears marks on the skin & improves complexion ; 3. Milk, Bargad & wheat germ oil clears uneven skin tone. Fair & Lovely Ayurvedic care cream is not just a cream, it’s a Golden Glow treatment.', 'ফেয়ার অ্যান্ড লাভলী ফেয়ারনেস ক্রিম আয়ুর্বেদিক কেয়ার সংবেদনশীল ত্বকের  জন্য বিশেষজ্ঞ আদর্শ ফেয়ারনেস ক্রিম । কুমকুমাদি তৈলমের সদ্ব্যবহারে ফেয়ার অ্যান্ড লাভলী আয়ুর্বেদিক কেয়ার ক্রিমের ১ টি উপাদান রয়েছে যা নিম্নলিখিত উপকারগুলি প্রদান করে:  ত্বককে প্রশান্তি দেয়,ত্বকের দাগ মুছে দেয় এবং বর্ণের উন্নতি করে । ফেয়ার অ্যান্ড লাভলী আয়ুর্বেদিক কেয়ার ক্রিমটি কেবল ক্রিম নয়, এটি গোল্ডেন গ্লো ট্রিটমেন্ট।', 'assets/images/products/1615710704fal a 50 g.png', '125', '১২৫', 50, 'g', NULL, NULL, NULL, 1, 0, '2020-08-23 23:55:08', '2021-03-14 08:31:44', 0, 0, 'Fair-and-Lovely-Fairness-Cream-Ayurvedic-Care', '0.00'),
