(573, 80, 1, NULL, 2, 'Fair & lovely multivitamin winter fairness cream', 'ফেয়ার এন্ড লাভলী মাল্টিভিটামিন উইন্টার ফেয়ারনেস ক্রিম', 'Fair & lovely multivitamin winter fairness cream gives you: the fairness of fair & lovely multivitamin. The goodness of active moisturizers. And the protection of sunscreens. Now get radiant fairness along with soft, supple skin in winter! new fair & lovely multivitamin winter fairness cream contains fairness multivitamins and active moisturizers to help give you radiant fairness along with soft, supple skin even in winter.', 'ফেয়ার এন্ড লাভলী মাল্টিভিটামিন উইন্টার ফেয়ারনেস ক্রিম দেয় ফর্সা এবং সুদৃশ্য ত্বকএবং সক্রিয় ময়শ্চারাইজারগুলির মঙ্গলভাবএবং সানস্ক্রিন সুরক্ষা। শীতকালে নরম, কোমল ত্বকের পাশাপাশি আলোকিত ফর্সা ত্বক পান! শীতকালে নরম, কোমল ত্বকের পাশাপাশি আপনাকে আলোকিত ফর্সা ত্বক প্রদান করতে সহায়তা করার জন্য নতুন ফেয়ার এন্ড  লাভলী মাল্টিভিটামিন উইন্টার ফেয়ারনেস ক্রিমে মাল্টিভিটামিন এবং সক্রিয় ময়শ্চারাইজার রয়েছে।', 'assets/images/products/1598213042571.webp', '120', '১২০', 50, 'g', NULL, NULL, NULL, 1, 0, '2020-08-24 00:04:02', '2020-10-15 04:48:23', 0, 0, 'Fair-lovely-multivitamin-winter-fairness-cream', '0.00'),
