(575, 77, 1, NULL, 2, 'Glow and Lovely Soap Bar Multani Mati 100g', 'গ্লো অ্যান্ড লাভলি সোপ বার মুলতানি মাটি', 'Get glowing skin with every bath because for the first time ever, fair and lovely’s proven formula is now in a soap. Introducing new fair and lovely soap infused with multivitamins. Its rich creamy lather gently cleanses the skin by removing oil and pollution, giving you a beautiful glow every day.', 'প্রতিটি গোসলের সাথে ঝলমলে ত্বক পান কারণ প্রথমবারের মতো, ন্যায্য এবং সুদৃঢ় প্রমাণিত সূত্রটি এখন একটি সাবানে রয়েছে। মাল্টিভিটামিনের সাথে সংযুক্ত নতুন ফর্সা এবং মনোরম সাবান উপস্থাপন করা হচ্ছে। এর সমৃদ্ধ ক্রিমযুক্ত লাথার আপনাকে প্রতিদিন একটি সুন্দর ঝলক দেয়, তেল এবং দূষণ দূর করে আলতো করে ত্বক পরিষ্কার করে।', 'assets/images/products/1621237725glow-&-lovely-Soap-Bar-Multani-Mati-100g.png', '40', '৪০', 100, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-24 00:09:21', '2021-05-17 07:48:45', 0, 0, 'Glow-and-Lovely-Soap-Bar-Multani-Mati-100gm', '0.00'),
