(684, 80, 105, NULL, 2, 'Lever Ayush Face Cream Anti Marks Turmeric', 'লিভার আয়ুষ ফেস ক্রিম অ্যান্টি মার্কস টারমেরিক', 'Ayush anti marks face cream contains the goodness of turmeric (haldi) known for its purification and antiseptic properties and kumkumadi tailam, to cure marks, lighten skin colour and improve skin’s quality for spot-less fair skin. Turmeric (haldi) is prescribed in ayurveda for purification and also well known for its antiseptic and healing properties.', 'আয়ুশ অ্যান্টি মার্কস ফেস ক্রিমটিতে হলুদ (হালদি) এর শুদ্ধতা এবং অ্যান্টিসেপটিক বৈশিষ্ট্য এবং কুমকুমাদি তাইলমের জন্য সুপরিচিত, ত্বকের যে কোন চিহ্ন নিরাময় করতে, ত্বকের রঙ হালকা করতে এবং স্পট-কম ফর্সা ত্বকের জন্য ত্বকের গুণমান উন্নত করে। হলুদ (হালদি) আয়ুর্বেদে বিশোধিত হয় শুদ্ধির জন্য এবং এটি এন্টিসেপটিক এবং নিরাময়ের বৈশিষ্ট্যের জন্যও সুপরিচিত।', 'assets/images/products/1615718592AYFCT25H.jpg', '80', '৮০', 25, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-24 21:51:30', '2021-04-01 14:38:01', 0, 0, 'Lever-Ayush-Face-Cream-Anti-Marks-Turmeric-25 gm', '0.00'),
(685, 80, 105, NULL, 2, 'Lever Ayush Face Cream Anti Marks Turmeric', 'লিভার আয়ুষ ফেস ক্রিম অ্যান্টি মার্কস হলুদি', 'Ayush anti marks face cream contains the goodness of turmeric (haldi) known for its purification and antiseptic properties and kumkumadi tailam, to cure marks, lighten skin colour and improve skin’s quality for spot-less fair skin. Turmeric (haldi) is prescribed in ayurveda for purification and also well known for its antiseptic and healing properties.', 'আয়ুশ অ্যান্টি মার্কস ফেস ক্রিমটিতে হলুদ (হালদি) এর শুদ্ধতা এবং অ্যান্টিসেপটিক বৈশিষ্ট্য এবং কুমকুমাদি তাইলমের জন্য সুপরিচিত, ত্বকের যে কোন চিহ্ন নিরাময় করতে, ত্বকের রঙ হালকা করতে এবং স্পট-কম ফর্সা ত্বকের জন্য ত্বকের গুণমান উন্নত করে। হলুদ (হালদি) আয়ুর্বেদে বিশোধিত হয় শুদ্ধির জন্য এবং এটি এন্টিসেপটিক এবং নিরাময়ের বৈশিষ্ট্যের জন্যও সুপরিচিত।', 'assets/images/products/1615718645AYFCT50H.jpg.png', '150', '১৫০', 50, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-24 21:54:47', '2021-03-14 10:44:05', 0, 0, 'Lever-Ayush-Face-Cream-Anti-Marks-Turmeric-50gm', '0.00'),
(686, 80, 105, NULL, 2, 'Lever Ayush Face Cream Natural Fairness Saffron', 'লিভার আয়ুষ ফেস ক্রিম প্রাকৃতিক ফেয়ারনেস জাফরান', 'Ayush Natural Face Cream is formulated with 5000 years of Ayurvedic wisdom to give you a golden glow. It contains the goodness of Saffron (Kesar) & Kumkumadi Tailam. Saffron (Kesar) is an Ayurvedic herb with great medicinal value known for its brightening & healing properties and Kumkumadi Tailam is a unique blend of 16 herbs & oil formulated to cure marks, lighten skin colour and improve skin’s quality to look beautiful and healthy. Extracts of Lodhra, Ushira and Neeloptal calm and soothe skin while Manjishtha, Kesar and Padmakashtha help clear marks.', 'আয়ুশ ন্যাচারাল ফেস ক্রিম আপনাকে একটি স্বর্ণালি আভা দেওয়ার জন্য 5000 বছরের আয়ুর্বেদিক জ্ঞান দিয়ে তৈরি করা হয়েছে। এটিতে জাফরান (কেশার) এবং কুমকুমাদি তৈলমের সার্থকতা রয়েছে। জাফরান (কেশার) একটি আয়ুর্বেদিক ওষধি যা তার উজ্জ্বলতা এবং নিরাময়ের বৈশিষ্ট্যগুলির জন্য পরিচিত এবং কুমকুমাদি তৈলাম 16 টি ভেষজ ও তেলের একটি অনন্য মিশ্রণ যা চিহ্নগুলি নিরাময় করতে, ত্বকের রঙ হালকা করার জন্য এবং ত্বকের মান উন্নত করতে সুন্দর এবং স্বাস্থ্যকর রূপ দেয়।', 'assets/images/products/1615718697AYFCS50H.jpg', '150', '১৫০', 50, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-24 22:03:19', '2021-03-14 10:44:57', 0, 0, 'Lever-Ayush-Face-Cream-Natural-Fairness-Saffron', '0.00'),
(687, 80, 105, NULL, 2, 'Lever Ayush Facewash Anti Pimple Turmeric', 'আয়ুষ অ্যান্টি পিম্পল হলুদ ফেসওয়াশ', 'Ayush Anti Pimple Turmeric Face Wash contains the goodness of Turmeric (Haldi), known for its purification and antiseptic properties and Nalpamaradi Tailam, a classical oil formulated with various effective ingredients such as Vetiver, Peepal and Amla to cure skin infections & rashes for clean & clear skin.', 'আয়ুষ অ্যান্টি পিম্পল হলুদ ফেস ওয়াশটিতে হলুদ (হালদি) এর শুভ্রতা রয়েছে যা এটি শুদ্ধকরণ এবং অ্যান্টিসেপটিক বৈশিষ্ট্যগুলির জন্য পরিচিত এবং নলপামারাদি তাইলম, ক্লাসিকাল তেল যা বিভিন্ন কার্যকর উপাদান যেমন ভেটিভার, পিপাল এবং আমলা দিয়ে তৈরি ।', 'assets/images/products/1615719073AYFWT40H.jpg.png', '90', '৯০', 40, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-24 22:08:54', '2021-04-01 14:38:45', 0, 0, 'Lever-Ayush-Facewash-Anti-Pimple-Turmeric-40 ml', '0.00'),
