(689, 80, 105, NULL, 2, 'Lever Ayush Facewash Natural Fairness Saffron', 'লিভার আয়ুষ ফেসওয়াশ প্রাকৃতিক ফেয়ারনেস জাফরান', 'Saffron (Kesar) is an Ayurvedic herb with great medicinal value known for its brightening & healing properties and Kumkumadi Tailam, a unique blend of 14 herbs & oil formulated to cure marks, lighten skin colour and improve skin\'s quality for a golden glow.', 'জাফরান (কেশার) একটি আয়ুর্বেদিক ওষধি যা এর উজ্জ্বলতা এবং নিরাময়ের বৈশিষ্ট্যের জন্য পরিচিত এবং কুমকুমাদি তাইলম, চিহ্নগুলি নিরাময়ের জন্য ত্বকের রঙ হালকা করার জন্য এবং ত্বকের মান উন্নত করার জন্য তৈরি করা ১৪ টি ভেষজ ও তেলের এক অনন্য মিশ্রণ।', 'assets/images/products/1615719250AYFWS80H.jpg.png', '165', '১৬৫', 80, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-24 22:15:46', '2021-04-01 14:39:35', 0, 0, 'Lever-Ayush-Facewash-Natural-Fairness-Saffron-80 ml', '0.00'),
(690, 78, 105, NULL, 2, 'Lever Ayush Shampoo Anti Dandruff Neem', 'লিভার আয়ুষ শ্যাম্পু এন্টি ড্যানড্রফ নিম', 'Ayush anti dandruff shampoo is formulated with 5000 years of ayurvedic wisdom to give you a healthy scalp and hair. It contains the goodness of neem, a universal healer, known in ayurveda which gently cleanses the scalp and prevents dandruff from coming back and rosemary tailam, a potent ayurvedic oil known to provide nourishment, promoting hair growth', 'আপনাকে একটি স্বাস্থ্যকর মাথার ত্বক এবং চুল দেওয়ার জন্য আয়ুশ অ্যান্টি ড্যানড্রাফ শ্যাম্পুটি 5000 বছরের আয়ুর্বেদিক প্রজ্ঞার সাথে তৈরি করছে। এটি নিমের সদ্ব্যবহার, সর্বজনীন নিরাময়কারী, যা আয়ুর্বেদে পরিচিত যা আস্তে আস্তে মাথার ত্বককে পরিষ্কার করে এবং খুশকি ফিরে আসতে বাধা দেয় ।', 'assets/images/products/1615719712AYSN175H.jpg.jpg', '195', '১৯৫', 175, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-24 22:20:09', '2021-03-14 11:01:52', 0, 0, 'Lever-Ayush-Shampoo-Anti-Dandruff-Neem', '0.00'),
(691, 78, 105, NULL, 2, 'Lever Ayush Shampoo Anti Hair Fall Bhringraj', 'লিভার আয়ুষ শ্যাম্পু এন্টি হেয়ার ফল ভ্রিংরাজ', 'Ayush shampoo is formulated with 5000 years of ayurvedic wisdom to give you healthy, strong hair. It contains the goodness of bhringaraj, an ancient herb that is known to prevent hair fall, making hair thick', 'আপনাকে স্বাস্থ্যকর, শক্তিশালী চুল দেওয়ার জন্য আয়ুর্বেদিক জ্ঞানের 5000 বছরের আয়ুশ শ্যাম্পুটি তৈরি করা হয়েছে। এটিতে ভ্রিংরাজের সদৃশতা রয়েছে, এটি একটি প্রাচীন ওষধি যা চুল পড়া রোধ করে এবং চুলকে ঘন করে তোলে।', 'assets/images/products/1615719754AYSB175H.jpg.jpg', '195', '১৯৫', 175, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-24 22:23:33', '2021-03-14 11:02:34', 0, 0, 'Lever-Ayush-Shampoo-Anti-Hair-Fall-Bhringraj', '0.00'),
(692, 78, 105, NULL, 2, 'Lever Ayush Shampoo Long & Strong Growth Shikakai', 'লিভার আয়ুষ শ্যাম্পু লং এন্ড স্ট্রং গ্রোথ  শিকাকাই', 'Ayush Long & Strong Shikakai shampoo is formulated with 5000 years of Ayurvedic wisdom for visibly thicker, longer hair. It contains the goodness of Shikakai, used since centuries as a natural cleanser and to promote hair growth. It also nourish and strengthen hair from the roots giving you long and strong hair.', 'আয়ুশ লং এন্ড স্ট্রং শিকাকাই শ্যাম্পু দৃশ্যমান ঘন, লম্বা চুলের জন্য 5000 বছরের আয়ুর্বেদিক প্রজ্ঞার সাথে তৈরি করা হয়েছে। এটিতে শিকাকাইয়ের মঙ্গলভাব রয়েছে, যা বহু শতাব্দী ধরে প্রাকৃতিক পরিষ্কারক হিসাবে এবং চুলের বৃদ্ধির জন্য ব্যবহৃত হয় । এটি আপনাকে লম্বা এবং শক্তিশালী চুল দেয় শিকড় থেকে চুল পুষ্ট এবং মজবুত করে।', 'assets/images/products/1615719865AYSS175H.jpg.jpg', '195', '১৯৫', 175, 'ml', NULL, NULL, NULL, 1, 0, '2020-08-24 22:28:52', '2021-03-14 11:04:25', 0, 0, 'Lever-Ayush-Shampoo-Long-Strong-Growth-Shikakai', '0.00'),
