(766, 112, 105, NULL, 2, 'Mens Fair And Lovely Face Wash Rapid Action 100 g', 'মেনস ফেয়ার অ্যান্ড লাভলি ফেস ওয়াশ র‌্যাপিড অ্যাকশন', 'Men\'s Fair and Lovely Rapid Action Instant Fairness facewash is designed for MEN\'s skin for 1-wash instant fair look.It eliminates impurities, leaving skin visibly bright in 1 wash, while ICY menthol leaves your skin feeling cool and fresh.Our Multivitamin Boost formula works with Rapid Action technology to gives you an instant bright look.It is safe to use daily, and does not contain any harmful chemicals.For best results, use MEN\'s Fair & Lovely instant fairness Rapid action cream after washing your face।', 'পুরুষদের ফেয়ার এবং লাভলি  র‌্যাপিড অ্যাকশন তাত্ক্ষণিক ফেয়ারনেস ফেসওয়াশ MEN এর ত্বকের জন্য 1-ওয়াশ তাত্ক্ষণিক ফর্সা চেহারা জন্য ডিজাইন করা হয়েছে t এটি অমেধ্যকে দূর করে, 1 ধোয়ার ফলে ত্বকে দৃশ্যমান উজ্জ্বল ছেড়ে দেয়, যখন আইসিওয়াই মেনথল আপনার ত্বককে শীতল এবং সতেজ বোধ করে। আমাদের মাল্টিভিটামিন বুস্ট সূত্র কাজ করে আপনাকে তাত্ক্ষণিক উজ্জ্বল চেহারা দেওয়ার জন্য র‌্যাপিড অ্যাকশন প্রযুক্তির সাহায্যে এটি প্রতিদিন ব্যবহার করা নিরাপদ এবং এতে কোনও ক্ষতিকারক রাসায়নিক নেই ।সর্বোত্তম ফলাফলের জন্য,  আপনার মুখ ধোয়ার পরে র‌্যাপিড অ্যাকশন ক্রিম ব্যবহার করুন ।', 'assets/images/products/1615953090FALFWMRA100H.jpg.jpg', '160', '১৬০', 100, 'gm', NULL, NULL, NULL, 1, 0, '2020-08-26 07:01:55', '2021-03-17 03:51:30', 0, 0, 'Mens-Fair-And-Lovely-Face-Wash-Rapid-Action-100gm', '0.00'),
